function dynamicLocator() {
	try {
		if ($('.js-dynamic-location-card').length) {
			var geoloc;
			var currentLocation;
			// google url to get current location by call google api
			var googleMapsGeoLocationApiUrl = 'https://www.googleapis.com/geolocation/v1/geolocate?key=AIzaSyCF38reM2D4yceqQ01YczuNkiIm76fDu2A';
			// google object to get current location by user input
			var geocoder = new google.maps.Geocoder();
			// fectbanks servlet url to get bank information.
			var fetchBanksServletUrl = '/bin/wintrust/fetchbanks';
            var DEFAULT = 'DEFAULT';

			var locationView = $('#location-view');
			var zipCodeSearchView = $('#zipcode-search-view');

			init();

			function init() {
				initGeoLocation();

				$(".change-location-link").on('click', function () {
					locationView.hide();
					zipCodeSearchView.show().removeClass().addClass('showdiv');
				});

				$('#location-searchbox-submit').on('click', function () {
					submitChangeLocation($('#searchbox-address-zipcode').val());
				});
			}

			function initGeoLocation() {
				try {
					// if browser does not support geolocation
					if (typeof navigator.geolocation === 'undefined') {
						geoloc = google.gears.factory.create('beta.geolocation');
					} else {
						geoloc = navigator.geolocation;
					}

					getCurrentLocation();
				} catch (e) {}
			}

			function submitChangeLocation(zipCodeOrAddress) {
				var zipCodeOrAddress = $('#searchbox-address-zipcode').val();
				getCoordinatesFromInput(zipCodeOrAddress)
			}

			function getCurrentLocation() {
				if (geoloc) {
					geoloc.getCurrentPosition(
						function (data) {
							var d = {
								"longitude": data.coords.longitude,
								"latitude": data.coords.latitude
							};

							if (data.address) {
								d["address"] = data.address
							}

							currentLocation = d;

							var banktype = $(".dynamiclocation-outer").data("type-tagid");

							fetchBank(currentLocation.latitude, currentLocation.longitude, banktype);

						},
						function (error) {
                            if($('.enableLocationText').val()=='true'){
                                showWealthLocation(DEFAULT);
                            }
							getLocationByGoogleApi();
						}
					);
				} else {
                    if($('.enableLocationText').val()=='true'){
                        showWealthLocation(DEFAULT);
                    }
					getLocationByGoogleApi();
				}
			}

			function getLocationByGoogleApi() {
				var referer = $(location).attr('host');
				$.ajax({
					'url': googleMapsGeoLocationApiUrl,
					'dataType': 'json',
					'async': true,
					method: 'POST',
					beforeSend: function (xhr) {
						xhr.setRequestHeader('X-Alt-Referer', referer);
					},
					contentType: 'application/json;charset=UTF-8',
					success: function (data, textStatus, jqXHR) {
						var responseInfo = data;
						if (data.error) {
							isFinding = false;
							return;
						}

						if (responseInfo.location) {
							var banktype = $(".dynamiclocation-outer").data("type-tagid");
							currentLocation = {
								'longitude': responseInfo.location.lng,
								'latitude': responseInfo.location.lat
							};
							fetchBank(currentLocation.latitude, currentLocation.longitude, banktype);
						}

					},
					error: function (response) {

					}
				});
			}

			function getCoordinatesFromInput(zipCodeOrAddress) {
				geocoder.geocode({
					'address': zipCodeOrAddress
				}, function (results, status) {
					if (status == 'OK') {
						if (results[0]) {
							if (results[0].geometry.location) {
								currentLocation = {
									'longitude': results[0].geometry.location.lng(),
									'currentLocation': results[0].geometry.location.lat()
								};
								var banktype = $(".dynamiclocation-outer").data("type-tagid");
								zipCodeSearchView.hide();
								locationView.show().addClass('showdiv');
								fetchBank(currentLocation.currentLocation, currentLocation.longitude, banktype);

							}

						}

					}
				});
			}

			//fetch the nearest bank information by coordinates from fetchBankServlet.
			function fetchBank(lat, lon, branchtype) {
				var hasbranchtype = false;
				var params = {
					'lat': lat,
					'lon': lon
				};
				if (branchtype) {
					params.branch_type = branchtype;
					hasbranchtype = true;
				}

				$.ajax({
					'url': fetchBanksServletUrl,
					'data': params,
					'async': true,
					'dataType': 'json',
					success: function (data, textStatus, jqXHR) {
						var bankInfo;
						if (hasbranchtype) {
							if ((data.results) && data.results.length > 0) {

								data.results.sort(function (a, b) {
									var distanceA = parseFloat(a.distance);
									var distanceB = parseFloat(b.distance);
									if (distanceA < distanceB) {
										return -1;
									}
									if (distanceA > distanceB) {
										return 1;
									}
									return 0;
								});

								bankInfo = data.results[0];
							}
						} else {
							bankInfo = data;
						}
						if (data.error) {
							return;
						}
						if (bankInfo) {
							/* If Show Default Location Text checkbox is enabled it will fetch default location text from dialog values */
                            var phoneNumber1 = '';
							var phoneNumber2 = '';
							
							var hourText = '<b>OPEN</b> until ' + getUntilHour(bankInfo.hours);
							$('#bank-hours-text').html(hourText);
							$('#bank-street-text').html(bankInfo.street_address);
							$('#bank-city-state-zip-text').html(bankInfo.city + ", " + bankInfo.state + " " + bankInfo.zipcode);
							if (bankInfo.phone_number) {
								phoneNumber1 = bankInfo.phone_number.substr(0, 3) + '-' + bankInfo.phone_number.substr(4, 8);
								phoneNumber2 = '(' + bankInfo.phone_number.substr(0, 3) + ') ' + bankInfo.phone_number.substr(4, 8);
								$('#bank-phonenumber-text1').html('<h3><a href="tel:' + bankInfo.phone_number + '">' + phoneNumber1 + '</a></h3>');
								$('#bank-phonenumber-text2').html('<h3><a href="tel:' + bankInfo.phone_number + '">' + phoneNumber2 + '</a></h3>');
							}
							var linkText = $('#browser-visit-website').data('link-text');
							$('#browser-visit-website').empty().append('<a href="' + bankInfo.web_site + '">' + linkText + '</a>');
							$('#bank-logo').html('<img src="' + bankInfo.logo + '" alt="' + bankInfo.bankImageAltText + '"/>');
							$('#mobile-visit-website').empty().append('<a href="' + bankInfo.web_site + '">' + linkText + '</a>');

                            if($('.enableLocationText').val()=='true'){
                                var stateID = bankInfo.state;                                
                                $('.set--font-size').addClass('set--font-size-wealth');
                                $('#bank-phonenumber-text1>h3>a').addClass('set--font-size-wealth');
				var target = $(".statesDefaultLocationText");
                                if(target.children('div.'+stateID).length == 0) {
                                   stateID = 'DEFAULT';
                                }
                                showWealthLocation(stateID);
                            }
						} else {
							//no results show the enter address
							locationView.hide();
							zipCodeSearchView.show().removeClass().addClass('showdiv');
						}

					},
					error: function (response) {}
				});
			}

            function showWealthLocation(stateID){
                var stText = '.'+$.trim(stateID)+' .stateText';
                var street = '.'+$.trim(stateID)+' .locationText .wintrust-bank-street';
                var city = '.'+$.trim(stateID)+' .locationText .wintrust-bank-city';
                var phone = '.'+$.trim(stateID)+' .locationText .wintrust-bank-phonenumber';
                var logo = '.'+$.trim(stateID)+' .locationText .wintrust-bank-logo';
                
                if($('.'+stateID).length != 0){
                    $('.branch-location > h1').html($(stText).html());
                    $('#bank-street-text').html($(street).html());
                    $('#bank-city-state-zip-text').html($(city).html());
                    /*
                    $('#bank-phonenumber-text1').html('<h3><a class="set--font-size-wealth" href="tel:' + $(phone).html() + '">' + $(phone).html() + '</a></h3>');
                    $('#bank-phonenumber-text2').html('<h3><a class="set--font-size-wealth" href="tel:' + $(phone).html() + '">' + $(phone).html() + '</a></h3>');
                    */
                    var phoneNo = "<h3><a class='set--font-size-wealth' href='tel:"+$(phone).html()+"'>"+$(phone).html()+"</a></h3>";
                    $('#bank-phonenumber-text1').html(phoneNo);
                    $('#bank-phonenumber-text2').html(phoneNo);
                    $('#bank-logo').html('<img src="' + $(logo).html() + '" alt="' + $(street).html() + '"/>');
                }
                
                $('#browser-visit-website').css('display','none');
                $('#mobile-visit-website').css('display','none');
                $('.change-location-link').css('display','none');
            }

			function getUntilHour(hours) {
				var hourStr = '';
				if (hours) {
					var dayNumber = new Date().getDay();
					var weekday = ["Sunday", "Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday"];
					var dayName = weekday[dayNumber];
					var hoursArry = hours.split(/\r?\n/);
					$.each(hoursArry, function (i, item) {
						if (item.indexOf(dayName) >= 0 && dayName != 'Sunday') {
							hourStr = item.split('-')[1];
						} else if (item.indexOf(dayName) >= 0 && dayName == 'Sunday') {
							hourStr = item.split(':')[1];
						}

					});
				}
				return hourStr;
			}

			//Enter Key fix
			$("#searchbox-address-zipcode").on('keyup', function (event) {
				if (event.keyCode == 13) {
					event.preventDefault();
					$("#searchbox-address-zipcode").focus();
					$("#location-searchbox-submit").on('click', function () {});
					submitChangeLocation($('#searchbox-address-zipcode').val());
				}
			});
		}
	} catch (error) {
		console.error('Google API Error');
	}

}

