        function isValid(element){
            
            var inputParent = $(element).parent();
            var valueFromElement = getValue(element);

            if (!isRequired(element) && !valueFromElement)
                return true;

            var validationType = inputParent.data('validation');
            var validator = validations[validationType];
            if (!validator)
                return true;
            return validator(valueFromElement) === true ? true : false;
        }

        function isRequired(element) {
            var inputParent = $(element).parent();
            return inputParent.data("required") === "Yes";     
        }

        function removeErrorIfValid(element){
            var errorElem = $(element).parent().find("span.error");

            if (isRequired(element) && getValue(element))
                errorElem.remove();
            else if (isValid(element)) {
                if (errorElem.length)
                    errorElem.remove();
            }
        }

        function getValue(element){
            var valueFromElement = $(element).val();

            if ((element.tagName == 'SELECT' && element.value == 'default')) {
                valueFromElement = null;
            }

            return valueFromElement;
        }

        //returns true if valid, false if invalid
        function showErrorIfInvalid(element) {
            var inputParent = $(element).parent();
            var valueFromElement = getValue(element);

            if (!isRequired(element) && !valueFromElement) {
                return true;
            }

            var validationType = inputParent.data('validation');
            var errorElem = $(element).parent().find("span.error");
            if (errorElem.length)
                errorElem.remove();
            var validator = validations[validationType];

            if (isRequired && !valueFromElement){
                $(element).after('<span class="error">Required Value *</span>');
                return false;
            }

            if (validator) {
                var result = validator(valueFromElement);
                if (result !== true) {
                    $(element).after('<span class="error">' + result + '</span>');
                    return false;
                } else {
                    return true;
                }
            }
            //no validation available, return true
            return true;
        }

