$(function() {

    if ($('.js-globalsearchfilter').length) {
        /* Global Search Filter */
        /* Topic and Date filter dropdowns:: if sibling dropdown(s) are not collapsed, collapse them
         * (Fixes .global-search-filters-browser, not an issue in mobile)
         */
        var searchResult;
        var globalSearchResultRow = $('#global-search-result-row');
        var errorText = globalSearchResultRow.data('error-text');
        var nextpaginatetext = globalSearchResultRow.data('next-text');
        var previouspaginatetext = globalSearchResultRow.data('previous-text');
        var resultsperpage = globalSearchResultRow.data('number-results');

        function getURLParameter(sParam) {
            var sPageURL = window.location.search.substring(1);
            var sURLVariables = sPageURL.split('&');

            for (var i = 0; i < sURLVariables.length; i++) {
                var sParameterName = sURLVariables[i].split('=');
                if (sParameterName[0] == sParam) {
                    return decodeURIComponent(sParameterName[1].replace(/\+/g,  " "));
                }
            }
        }

        $('.areasearch-collapse').on('show.bs.collapse', function() {
            $(this).siblings('.collapse-title').addClass('collapsed');
            $(this).siblings('.areasearch-collapse').removeClass('show');
        });

        /*check url for arguments.  If searchterm passed as an argument, execute a search with that
         * value*/
        var searchterm = getURLParameter('searchterm');
        if (searchterm && searchterm.length) {
            var globalSearchFiltersBrowser = $('.global-search-filters-browser');
            var searchPath = globalSearchFiltersBrowser.data('search-path');
            var componentPath = globalSearchFiltersBrowser.data('component-path');

            resetFilter();
            $.ajax({
                //The URL to process the request
                'url': '/bin/wintrust/sitesearch',
                'type': 'GET',
                'data': {
                    'search_term': searchterm,
                    'path': searchPath,
                    'componentPath': componentPath
                },
                //The response from the server
                'success': function(data) {
                    searchResult = data;
                    datalayerGeneralSearchEvent(searchterm, data);
                    showResults(data);
                    paginate();
                    $('#global-searchbox-search-term').val(searchterm);
                }
            });
        }

        $('#global-searchbox-submit').on('click', function() {
            var searchTerm = $('#global-searchbox-search-term').val();
            var globalSearchFiltersBrowser = $('.global-search-filters-browser');
            var searchPath = globalSearchFiltersBrowser.data('search-path');
            var componentPath = globalSearchFiltersBrowser.data('component-path');
            resetFilter();
            $.ajax({
                //The URL to process the request
                'url': '/bin/wintrust/sitesearch',
                'type': 'GET',
                'data': {
                    'search_term': searchTerm,
                    'path': searchPath,
                    'componentPath': componentPath
                },
                //The response from the server
                'success': function(data) {
                    searchResult = data;
                    datalayerGeneralSearchEvent($('#global-searchbox-search-term').val(), data);
                    showResults(data);
                    paginate();
                }
            });
        });

        init();

        function init() {
            var searchTerm = $('#global-search-box').data('search-term');
            $('#global-searchbox-search-term').val($('#global-search-box').data('search-term'));
            if (searchTerm != undefined && searchTerm != '') {
                $('#global-searchbox-submit').trigger('click');
            }
        }

        function resetFilter() {
            $('#search-filter-topic > label > input').each(function() {
                $(this).prop('checked', false);
            });
            $('.search-filter-date label > input').each(function() { //works for both browser & mobile
                $(this).prop('checked', false);
            });
            $('.areasearch-collapse').siblings('.collapse-title').addClass('collapsed');
            $('.areasearch-collapse').siblings('.areasearch-collapse').removeClass('in');
            $('#publish-date-within-label, #publish-date-within-label-mobile').html('Publish Date Within ');
            $('#selected-tag-label').html('Topics Include ');
        }

        function showResults(data) {
            if (data != null && data.length > 0) {
                var resultNumbers = '<div class="result-numbers"></div>';
                var resultItems = '';
                $.each(data, function(i, result) {
                	if(typeof result.title !== 'undefined' && result.title !== '') {
	                    resultItems += '<div class="result-row">';
	                    resultItems += '<div class="result-title"><h2><a href="' + result.path + '.html" ';
	                    resultItems += 'onclick=datalayerGeneralSearchResult(event)>';
	                    resultItems += result.title + '</a></h2></div>';
	                    resultItems += '<div class="result-desc">' + result.description + '</div></div>';
                	}
                });
                $('.search-results-browser').html(resultNumbers + resultItems);
                $('.search-results-mobile').html(resultNumbers + resultItems);
            } else {
                $('.search-results-mobile').html(errorText);
                $('.search-results-browser').html(errorText);
            }
        }
        
        $('.mobile-tag-filter').on('click change', function() {
            filterResult(searchResult);
            paginate();
        });

        $('.mobile-date-filter').on('click change', function() {
            $('#publish-date-within-label-mobile').html('Publish Date Within ' + $(this).parent().text());
            filterResult(searchResult);
            paginate();
        });

        $('#mobile-date-clear').on('click', function() {
            $('#publish-date-within-label-mobile').html('Publish Date Within');
            $('.mobile-date-filter').each(function() {
                $(this).prop('checked', false);
            });
            filterResult(searchResult);
            paginate();
        });

        $('#search-filter-topic > label > input').on('click change', function() {
            filterResult(searchResult);
            paginate();
        });

        $('.search-filter-date > label > input').on('click change', function() {
            $('#publish-date-within-label').html('Publish Date Within ' + $(this).parent().text() + ' ');
            filterResult(searchResult);
            paginate();
        });

        $('#global-searchfilter-clear').on('click', function() {
            $('#publish-date-within-label').html('Publish Date Within ');
            $('.search-filter-date label > input').each(function() {
                $(this).prop('checked', false);
            });
            filterResult(searchResult);
            paginate();
        });

        $('#global-searchbox-search-term').on('keyup', function(e) {
            if (e.keyCode == 13) {
                $('#global-searchbox-submit').trigger('click');
            }
        });

        function filterResult(searchResult) {
            var topicArray = new Array();
            var displayTitle = "Topics Including "; //may be multiple topics selected, using this label seems most elegant
            var filterResultArray = new Array();
            $('#search-filter-topic > label > input').each(function(i, item) {
                if (item.checked) {
                    topicArray.push(item.value);
                    if (i > 0)
                        displayTitle += ", "
                    displayTitle += item.nextSibling.nodeValue;
                }
            });
            //for mobile
            $('.mobile-tag-filter').each(function(i, item) {
                if (item.checked) {
                    topicArray.push(item.value);
                    if (i > 0)
                        displayTitle += ", "
                    displayTitle += item.nextSibling.nodeValue;
                }
            });
            if (topicArray.length == 0) {
                filterResultArray = searchResult;
            } else {
                $.each(searchResult, function(i, item) {
                    var isMatched = false;
                    $.each(item.tags, function(i, tag) {
                        if ($.inArray(tag, topicArray) >= 0) {
                            isMatched = true;
                            return false;
                        }
                    });
                    if (isMatched == true) {
                        filterResultArray.push(item);
                    }
                });

            }
            $("#selected-tag-label").html(displayTitle);
            //
            var date = new Date();
            var dateType = "";
            $('.search-filter-date label > input').each(function(i, item) {
                if (item.checked == true) {
                    dateType = $(this).val();
                }
            });
            $('.mobile-date-filter').each(function(i, item) {
                if (item.checked == true) {
                    dateType = $(this).val();
                }
            });

            if (dateType == 'week') {
                date = date.setDate(date.getDate() - 7);
            } else if (dateType == 'month') {
                date = date.setMonth(date.getMonth() - 1);
            } else if (dateType == 'year') {
                date = date.setYear(date.getYear() - 1);
            } else if (dateType == "") {
                showResults(filterResultArray);
                return;
            }
            var dateArray = Array();
            $.each(filterResultArray, function(i, item) {
                var publishDate = new Date(item.publishDate);
                if (publishDate > date) {
                    dateArray.push(item);
                }
            });

            showResults(dateArray);
        }

        function paginate() {
            $('#global-search-result-row').find('.pager').remove();
            var isMobile = false;
            if ($(window).width() < 768) {
                isMobile = true;
            }            
            var currentPage = 0;
            var numPerPage = 3;
            if (!isMobile) {
                numPerPage = resultsperpage;
            }
            var $item;

            if (isMobile) {
                $item = $('.search-results-mobile');
            } else {
                $item = $('.search-results-browser');
            }
            var numRows = $item.find('.result-row').length;
            $item.on('repaginate', function() {
                $item.find('.result-row').hide().slice(currentPage * numPerPage, (currentPage + 1) * numPerPage).show();
                $("body").scrollTop(0);
                if (!isMobile) {
                    showResultNumber(currentPage, numPerPage, numRows, numPages);
                }
            });
            $item.trigger('repaginate');

            var numPages = Math.ceil(numRows / numPerPage);
            if (numPages > 1) {
                if (isMobile) {
                    var $moreButton = $('<div class="mobile-show-more"></div>')
                        .append('<button id="mobile-show-more" class="btn primary-btn"><h3>Show More</h3></button>')
                        .on('click', function() {
                            numPerPage += 3;
                            $item.trigger('repaginate');
                            if (numPerPage >= (3 * numPages)) {
                                $(this).hide(); // no more results to show- hide 'Show More' button
                            }
                            $('.page-number').each(function() {
                                var tmpPgNum = parseInt($(this).text());
                                if (tmpPgNum <= (currentPage + 1)) {
                                    $(this).addClass('active');
                                } else {
                                    $(this).removeClass('active');
                                }
                            });
                        });
                    $(".search-results-mobile").append($moreButton);
                    
                    // Pagination change start                    
                } else {

                     pageNumbers();
                }
            }   

        function prevPageNumber(resultsPager) {

                $('<div class="previous"></div>').append('<h3><a>' + previouspaginatetext + '</a></h3>').on('click', function(event) {

                    if (currentPage > 0) {

                        currentPage--;
                    } else {
                        currentPage = numPages - 1;
                    }
                     $item.trigger('repaginate');
                    pageNumbers();
                    $('.page-number').each(function () {
                        var currPageLink = $(this);
                        var tmpPgNum = parseInt(currPageLink.text());
                        if (tmpPgNum === (currentPage + 1)) {
                            currPageLink.addClass('active');
                        } else {
                            currPageLink.removeClass('active');
                        }
                    });
                }).appendTo(resultsPager);
                return resultsPager;
            }

            function nextPageNumber(resultsPager) {

                $('<div class="next"></div>').append('<h3><a>' + nextpaginatetext + '</a></h3>').on('click', function(event) {

                    if (currentPage + 1 < numPages) {
                        currentPage++;
                    } else {
                        currentPage = 0;
                    }
                     $item.trigger('repaginate');
                    pageNumbers();
                    $('.page-number').each(function () {
                        var currPageLink = $(this);
                        var tmpPgNum = parseInt(currPageLink.text());
                        if (tmpPgNum === (currentPage + 1)) {
                            currPageLink.addClass('active');
                        } else {
                            currPageLink.removeClass('active');
                        }
                    });
                }).appendTo(resultsPager);
                return resultsPager;
            }

            function pageNumbers() {

                var resultsPager = $('<div class="pager"></div>');
                resultsPager = prevPageNumber(resultsPager);

                // Determines what page #s to be displayed
                var page;
                var endPage;
                if (currentPage < 4) {
                    page = 0;
                    if (numPages < 10) {
                        endPage = numPages;
                    } else {
                        endPage = 10;
                    }
                } else if (numPages < 10) {
                    page = 0;
                    endPage = numPages;
                } else if (currentPage > numPages - 6) {
                    page = numPages - 10;
                    endPage = numPages;
                } else {
                    page = currentPage - 4;
                    endPage = currentPage + 6;
                }
                for (page; page < endPage; page++) {
                    $('<div class="page-number"></div>').append('<h3><a>' + (page + 1) + '</a></h3>').on('click', {
                        newPage: page
                    }, function (event) {
                        currentPage = event.data['newPage'];
                         $item.trigger('repaginate');
                        pageNumbers();
                        $('.page-number').each(function () {
                            var currPageLink = $(this);
                            var tmpPgNum = parseInt(currPageLink.text());
                            if (tmpPgNum === (currentPage + 1)) {
                                currPageLink.addClass('active');
                            } else {
                                currPageLink.removeClass('active');
                            }
                        });
                    }).appendTo(resultsPager).addClass('clickable');
                }

                resultsPager = nextPageNumber(resultsPager);

                $('#global-search-result-row').find('.pager').remove();
                resultsPager.insertAfter($item).find('div.page-number:first').addClass('active');
            }
        }            // Pagination change end

        function showResultNumber(currentPage, numPerPage, numRows, numPages) {

            var endRow = (currentPage + 1) * numPerPage;
            if (numPages == currentPage + 1) {
                endRow = numRows;
            }
            if (numPerPage > numRows) {
                endRow = numRows;
            }
            var startRow = currentPage * numPerPage + 1;
            var resultNumbers = startRow + '-' + endRow + ' of ' + numRows + '</div>';
            //if startRow and endRow are valid numbers
            if ($.isNumeric(startRow) && $.isNumeric(endRow)) {
                $('.result-numbers').html(resultNumbers);
            }
        }
        
        function datalayerGeneralSearchEvent(searchTerm, data) {
            if(searchTerm) {
                searchTerm = searchTerm.toLowerCase().trim();
            }

            var eventDetails = {
                "event": "useGeneralSearch",
                "generalSearch": {
                    "term": searchTerm,
                    "results": data.length
                }
            };
            WintrustFED.sendComplexDataLayerEvent(eventDetails);
        }
                
    }

});

function datalayerGeneralSearchResult(event) {
    var searchResult = {
        "event": "clickSearchResult",
        searchResult: {
            "linkText": event.target.innerText
        }
    }
    WintrustFED.sendComplexDataLayerEvent(searchResult);
}

