var WintrustFED = WintrustFED || {};

//provides letters for AA thru ZZ, in case number of results is > 26
function colName(n) {
    var ordA = 'a'.charCodeAt(0);
    var ordZ = 'z'.charCodeAt(0);
    var len = ordZ - ordA + 1;

    var s = "";
    while (n >= 0) {
        s = String.fromCharCode(n % len + ordA) + s;
        n = Math.floor(n / len) - 1;
    }
    return s;
}

WintrustFED.locationMap = null;
WintrustFED.currentLocation = {};
WintrustFED.initMap = function () {
    if (typeof WintrustFED.currentLocation.latitude === 'undefined') {
        setTimeout(WintrustFED.initMap, 150);
        return;
    }
    WintrustFED.locationMap = new google.maps.Map(document.getElementById('location-google-map'), {
        center: {
            lat: WintrustFED.currentLocation.latitude,
            lng: WintrustFED.currentLocation.longitude
        },
        zoom: 11,
        mapTypeId: google.maps.MapTypeId.ROADMAP
    });
    google.maps.event.trigger(WintrustFED.locationMap, 'resize');
};


$(function () {
    if ($(".js-locationsearch").length) {

        //redraw map after click on tab
        $('.nav #mapTab').on('click', function () {
            var timeout,
                animationOffset = 100;

            function redrawGoogle() {
                google.maps.event.trigger(WintrustFED.locationMap, 'resize');
            }

            timeout = setTimeout(redrawGoogle, animationOffset);
        });
        var geoloc = null;
        var currentLocation;
        // google url to get current location by call google api
        var googleMapsGeoLocationApiUrl = 'https://www.googleapis.com/geolocation/v1/geolocate?key=AIzaSyCF38reM2D4yceqQ01YczuNkiIm76fDu2A';
        // google object to get current location by user input
        var geocoder = new google.maps.Geocoder();
        // fectbanks servlet url to get bank information.
        var fetchBanksServletUrl = '/bin/wintrust/fetchbanks';

        var fetchATMsServletUrl = '/bin/wintrust/location/atm/search';
        var defaultlogo = $("#search-area").data("default-logo");
        var searchRadius = $("#search-area").data("search-radius");
        var bankInformations;
        var atmInformations;
        var addressOrZip;
        var atmSearch = false;

        function getURLParameter(sParam) {
            var sPageURL = window.location.search.substring(1);
            var sURLVariables = sPageURL.split('&');

            for (var i = 0; i < sURLVariables.length; i++) {
                var sParameterName = sURLVariables[i].split('=');
                if (sParameterName[0] == sParam) {
                    return sParameterName[1];
                }
            }
        }

        var markers = [];

        // tags relationship between site type and branch type
        // e.g. if site type is banking, search branch type=community-banks
        var TAGS_RELATION = {
            'wintrust:sitetype/banking': 'wintrust:location/type/branch/community-banks',
            'wintrust:sitetype/mortgage': 'wintrust:location/type/branch/mortgage-office',
            'wintrust:sitetype/wealth': 'wintrust:location/type/branch/wealth-management-office',
            'wintrust:sitetype/corporate': 'all'
        };

        init();

        function init() {
            initGeoLocation();
            //executeSearch using current location onload

            /*check url for arguments.  If searchterm passed as an argument, execute a search with that
             * value*/
            var searchterm = getURLParameter('address_or_zip');
            if (!(searchterm && searchterm.length)) {
                getCurrentLocation();
            }

            //if user hits enter instead of clicking submit button
            $("#searchbox-address-zipcode").on('keyup', function (e) {
                if (e.keyCode == 13) {
                    $('#location-searchbox-submit').trigger('click');
                }
            });

            $('#location-searchbox-submit').on('click', function () {
                addressOrZip = $('#searchbox-address-zipcode').val();
                getCoordinatesFromInput(addressOrZip);
            });

            $('#search-by-mylocation').on('click', function () {
                addressOrZip = '';
                getCurrentLocation();
            });

            var filterTypeList = $('.filter-type-list');

            filterTypeList.find('li.filter-type-item').on('click', function () {
                var type = $(this).attr('location-type');
                if (type == 'BRANCH') {
                    fetchBanks(currentLocation.latitude, currentLocation.longitude, $(this).attr('type-id'), searchRadius);
                } else if (type == 'ATM') {
                    fetchATMs(currentLocation.latitude, currentLocation.longitude, $(this).attr('type-id'));
                }
            });

            filterTypeList.find('li.sort-type-item').on('click', function () {
                var sortType = $(this).data('sort-type');
                if (typeof sortType === 'undefined') {
                    console.error('Unable to sort. Filter is missing type.');
                    return;
                }

                clearMarkers();
                if (atmSearch) {
                    atmInformations = sortBankInformation(atmInformations, sortType);
                    showSearchResults(atmInformations, true);
                    setMapMarkers(atmInformations, true)
                } else {
                    bankInformations = sortBankInformation(bankInformations, sortType);
                    showSearchResults(bankInformations, true);
                    setMapMarkers(bankInformations, true)
                }
            });

            addressOrZip = $('#searchbox-address-zipcode').val();
            if (addressOrZip != 'undefined' && addressOrZip != '') {
                $('#location-searchbox-submit').trigger('click');
            }

            var searchCurrent = $('#location-search-address-zipcode').attr('searchcurrent');
            if (searchCurrent) {
                $('#search-by-mylocation').trigger('click');
            }

        }

        function initGeoLocation() {
            try {
                // if browser does not support geolocation
                if (typeof navigator.geolocation === 'undefined') {
                    geoloc = google.gears.factory.create('beta.geolocation');
                } else {
                    geoloc = navigator.geolocation;
                }
            } catch (e) {
                console.error("Error in initGeoLocation");
                console.error(e);
            }
        }

        function getLocationByGoogleApi() {
            $.ajax({
                'url': googleMapsGeoLocationApiUrl,
                method: 'POST',

                success: function (data, textStatus, jqXHR) {
                    var responseInfo = data;
                    if (data.error) {
                        isFinding = false;
                        return;
                    }

                    if (responseInfo.location) {
                        currentLocation = {
                            'longitude': responseInfo.location.lng,
                            'latitude': responseInfo.location.lat
                        };
                        WintrustFED.currentLocation = currentLocation;
                        fetchBanks(currentLocation.latitude, currentLocation.longitude, getBranchType(), searchRadius);
                    }
                }
            });
        }

        var geolocPosition = null;
        function getCurrentLocation() {
            // getCurrentPosition can only be called once in Internet Explorer
            if (geolocPosition) {
                currentLocation = WintrustFED.currentLocation = geolocPosition;
                if (WintrustFED.locationMap == null) {
                    WintrustFED.initMap();
                }
                fetchBanks(currentLocation.latitude, currentLocation.longitude, getBranchType(), searchRadius);
                return;
            }
            if (geoloc) {
                geoloc.getCurrentPosition(
                    function (data) {
                        geolocPosition = {
                            "longitude": data.coords.longitude,
                            "latitude": data.coords.latitude
                        };

                        if (data.address) {
                            geolocPosition["address"] = data.address
                        }

                        currentLocation = WintrustFED.currentLocation = geolocPosition;
                        if (WintrustFED.locationMap == null) {
                            WintrustFED.initMap();
                        }
                        fetchBanks(currentLocation.latitude, currentLocation.longitude, getBranchType(), searchRadius);
                    },
                    function (error) {
                        console.error("geoloc.getCurrentPosition error:");
                        console.error(error);

                        if (error.code == 1) {
                            console.error('error #1: ' + 'permission denied message from geolocation service');
                        } else if (error.code == 2) {
                            console.error('error #2: ' + 'geolocation service could not find location');
                        } else if (error.code == 3) {
                            console.error('error #3: ' + 'timeout while connecting geolocation service');
                        } else {
                            console.error('error #4: ' + 'error');
                        }

                        getLocationByGoogleApi();
                    }
                );
            } else {
                getLocationByGoogleApi();
            }
        }

        function getCoordinatesFromInput(zipCodeOrAddress) {
            geocoder.geocode({
                'address': zipCodeOrAddress
            }, function (results, status) {

                // Fix for not updating search results on invalid search!
                if (status == "ZERO_RESULTS") {
                    if ($('#ShowingResults')) {
                        $('#ShowingResults').remove();
                    }
                    $('.location-search-results-list').before('<div id="ShowingResults">Showing results for \'' + addressOrZip + '\'</div>');
                    $('.location-search-results-list').html($('#noResultsText').attr('class'));
                    datalayerLocationSearchEvent(zipCodeOrAddress, 0);
                    return;
                }

                if (status == 'OK') {
                    if (results[0]) {
                        if (results[0].geometry.location) {
                            currentLocation = {
                                'longitude': results[0].geometry.location.lng(),
                                'latitude': results[0].geometry.location.lat()
                            };
                            WintrustFED.currentLocation = currentLocation;
                            if ($('#location-search-address-zipcode').attr('viewmap') != 'true') {
                                fetchBanks(currentLocation.latitude, currentLocation.longitude, getBranchType(), searchRadius);
                            } else {
                                setTimeout(function () {
                                    clearMarkers();
                                    setMapMarkers('', true);
                                }, 2000);
                            }
                        }
                    }
                } else {
                    console.error('Geocode was not successful for the following reason: ' + status);
                }
            });
        }

        function getBranchType() {
            // Get site type property.
            var siteType = $('#location-search-address-zipcode').attr('sitetype');
            var branchType = TAGS_RELATION[siteType];
            return branchType;
        }

        var tempSearchRadius = searchRadius;

        function fetchATMs(lat, lon, type) {
            atmSearch = true;
            if (!tempSearchRadius)
                tempSearchRadius = 20;
            $('.location-search-maps-label').html('');
            $.ajax({
                'url': fetchATMsServletUrl,
                'data': {
                    'latitude': lat,
                    'longitude': lon,
                    'type': type,
                    'radius': tempSearchRadius
                },
                'async': true,
                'dataType': 'json',
                success: function (data, textStatus, jqXHR) {
                    var responseInfo = data;
                    if (data.error) {
                        //isFinding = false;
                        tempSearchRadius = searchRadius;
                        return;
                    }

                    if (responseInfo) {
                        atmInformations = responseInfo;

                        $.ajax({
                            'url': fetchBanksServletUrl,
                            'data': {
                                'lat': lat,
                                'lon': lon,
                                'branch_type': 'all',
                                'radius': tempSearchRadius
                            },
                            'async': true,
                            'dataType': 'json',
                            success: function (data, textStatus, jqXHR) {
                                var responseInfo = data;
                                if (data.error) {
                                    //isFinding = false;
                                    tempSearchRadius = searchRadius;
                                    return;
                                }

                                if (responseInfo.results) {
                                    var tempresults = responseInfo.results;
                                    if ($('#ShowingResults')) {
                                        $('#ShowingResults').remove();
                                    }


                                    if (tempresults.length == 0 && atmInformations.length == 0) {
                                        tempSearchRadius = tempSearchRadius * 2;
                                        fetchATMs(lat, lon, type);
                                        return;
                                    }
                                    for (var i = tempresults.length - 1; i >= 0; i--) {
                                        if (type == 'surchargefree') {
                                            if (tempresults[i].services == undefined || !tempresults[i].services.includes('Surcharge')) {
                                                tempresults.splice(i, 1);
                                            }
                                        } else if (type == 'cardless') {
                                            if (tempresults[i].services == undefined || !tempresults[i].services.includes('Cardless')) {
                                                tempresults.splice(i, 1);
                                            }
                                        }
                                    }
                                    if (tempresults.length != 0 || atmInformations.length != 0) {
                                        var showAll = true;
                                        var message;

                                        for (var i = atmInformations.length - 1; i >= 0; i--) {
                                            for (var k = 0; k < tempresults.length; k++) {
                                                if (atmInformations[i].name == tempresults[k].name) {
                                                    atmInformations.splice(i, 1);
                                                    break;
                                                }
                                            }
                                        }
                                        tempresults = tempresults.concat(atmInformations);
                                        bankInformations = sortBankInformation(tempresults, 'distance');

                                        if (tempSearchRadius > 100) {
                                            showAll = false;
                                            $('.location-search-maps-label').html('<span>No locations found within 100 miles. Showing closest location');
                                        } else {
                                            showLocationLabel(bankInformations, tempSearchRadius);
                                        }

                                        // show search result on the left side of panel
                                        showSearchResults(bankInformations, showAll);
                                        // clear marker/dots on the map
                                        clearMarkers();
                                        // set marker/dots on the map for banks
                                        setMapMarkers(bankInformations, showAll);
                                        // show location label on the right side of map panel
                                        //showLocationLabel(bankInformations, searchRadius);
                                        tempSearchRadius = searchRadius;
                                    } else {
                                        tempSearchRadius = tempSearchRadius * 2;
                                        fetchATMs(lat, lon, type);
                                        return;
                                    }
                                }
                            },
                            error: function (response) {
                                tempSearchRadius = searchRadius;
                            }
                        });
                    }
                }
            });
        }

        //fetch bank information by coordinates from fetchBankServlet.
        function fetchBanks(lat, lon, branchType, searchRadius) {
            atmSearch = false;
            if (!searchRadius)
                searchRadius = 20;
            $('.location-search-maps-label').html('');
            $.ajax({
                'url': fetchBanksServletUrl,
                'data': {
                    'lat': lat,
                    'lon': lon,
                    'branch_type': branchType,
                    'radius': searchRadius
                },
                'async': true,
                'dataType': 'json',
                success: function (data, textStatus, jqXHR) {
                    var responseInfo = data;
                    if (data.error) {
                        //isFinding = false;
                        return;
                    }

                    if (responseInfo.results) {
                        var tempresults = responseInfo.results;
                        datalayerLocationSearchEvent(addressOrZip, tempresults.length);
                        if ($('#ShowingResults')) {
                            $('#ShowingResults').remove();
                        }

                        if (searchRadius < 100) {
                            if (tempresults.length == 0) {
                                fetchBanks(lat, lon, branchType, searchRadius * 2);
                                return;
                            }
                            bankInformations = sortBankInformation(tempresults, 'distance');
                            // clear marker/dots on the map
                            clearMarkers();
                            // show search result on the left side of panel
                            showSearchResults(bankInformations, true);
                            // set marker/dots on the map for banks
                            setTimeout(function(){
                                setMapMarkers(bankInformations, true);
                            }, 200);
                            // show location label on the right side of map panel
                            showLocationLabel(bankInformations, searchRadius);
                        } else {
                            if (tempresults.length == 0) {
                                $('.location-search-maps-label').html('<span>No locations found within 100 miles. Showing closest location');
                                return;
                            } else {
                                bankInformations = sortBankInformation(tempresults, 'distance');
                                // show search result on the left side of panel
                                showSearchResults(bankInformations, false);
                                // clear marker/dots on the map
                                clearMarkers();
                                // set marker/dots on the map for banks
                                setMapMarkers(bankInformations, false);
                                // show location label on the right side of map panel
                            }
                        }

                    }
                }
            });
        }
        
        function showLocationLabel(bankInformations, searchRadius) {
            var bankCount = bankInformations.length;
            if (addressOrZip == 'undefined' || addressOrZip == '') {
                /*addressOrZip = '[latitude: ' + currentLocation.latitude + ', ' +
                 'longitude: ' + currentLocation.longitude.toFixed(7) + ']';*/
                addressOrZip = 'your current location';
            }
            var message = '<span>' + bankCount + ' Locations within ' + searchRadius + ' miles of ' + "'" + addressOrZip + "'</span>";
            $('.location-search-maps-label').html(message);
        }

        function clearMarkers() {
            for (var i = 0; i < markers.length; i++) {
                markers[i].setMap(null);
            }
            markers = [];
        }

        function setMapMarkers(bankInformations, displayAll) {
            if (WintrustFED.locationMap == null) {
                WintrustFED.initMap();
            }
            //create empty LatLngBounds object
            // bounds is map area
            var bounds = new google.maps.LatLngBounds();
            var infowindow = new google.maps.InfoWindow();

            var letterMap = new Object();
            for (i = 0; i < bankInformations.length; i++) {
                var letter = '';
                if (i < 125) { // arbitrary limit, lettering starts at A & ends at DU
                    letter = colName(i).toUpperCase();
                    letterMap[i] = letter;
                }

                var marker = new google.maps.Marker({
                    position: new google.maps.LatLng(bankInformations[i]['latitude'],
                        bankInformations[i]['longitude']),
                    label: letter,
                    map: WintrustFED.locationMap
                });
                markers.push(marker);
                //add each bank/marker position to bounds
                bounds.extend(marker.position);

                google.maps.event.addListener(marker, 'click', (function (marker, i) {
                    return function () {
                        var index = i + 1;

                        var HoursArr = bankInformations[i].hours.split(/\r?\n/);
                        var servicesArr = bankInformations[i].services.split(/\r?\n/);
                        var hoursStr = '';
                        var servicesStr = '';
                        $.each(HoursArr, function (i, hoursItem) {
                            hoursStr += hoursItem + '<br/>';
                        });
                        $.each(servicesArr, function (i, serviceItem) {
                            servicesStr += serviceItem + '<br/>';
                        });

                        var childInformation = '<a href="javascript:void(0);" id="map-info-back">BACK</a>';
                        childInformation += '<br><div><span><b>Hours</b></span><div>' + hoursStr + '</div></div>';
                        childInformation += '<div><span><b>Services</b></span><div>' + servicesStr + '</div></div>';
                        var bankInformation = '<b>' + letterMap[i] + '.</b> ';
                        bankInformation += '<b>' + bankInformations[i]['name'] + '</b> ';
                        var clickedBankName = bankInformations[i]['name'];
                        bankInformation += '<br><br>' + bankInformations[i]['street_address'];
                        bankInformation += '<br>' + bankInformations[i]['city'] + ", ";
                        bankInformation += bankInformations[i]['state'] + ' ' + bankInformations[i]['zipcode'];
                        bankInformation += '<br><br><a href="tel:' + bankInformations[i]['phone_number'] + '">' + bankInformations[i]['phone_number'] + '</a>';
                        bankInformation += '<br>' + '<a href="javascript:void(0);" id="map-info-id-' + i + '">Services & Hours View</a>';
                        infowindow.setContent(bankInformation);
                        infowindow.open(WintrustFED.locationMap, marker);

                        // scroll to corresponding search result on the left side
                        // when right side marker is clicked
                        if (index < bankInformations.length || bankInformations.length == 1) {
                            document.getElementById('result-id-' + index).scrollIntoView();
                        } else {
                            document.getElementById('result-id-' + i).scrollIntoView();
                        }

                        var locationSearchResult = {
                            "event": "clickLocationSearchResult",
                            locationSearchResult: {
                                "linkText": clickedBankName
                            }
                        }
                        WintrustFED.sendComplexDataLayerEvent(locationSearchResult);

                        // add listener for service hour and back button in child window
                        google.maps.event.addListener(infowindow, 'domready', function () {
                            $('#map-info-id-' + i).on('click', function () {
                                infowindow.setContent(childInformation);
                                WintrustFED.sendSimpleDataLayerEvent("clickServicesHoursViewLocationSearchResult");
                            });

                            $('#map-info-back').on('click', function () {
                                infowindow.setContent(bankInformation);
                            });

                        });
                    }
                })(marker, i));
                if (!displayAll) {
                    break;
                }
            }

            // set marker that i am here
            var myMarker = new google.maps.Marker({
                position: new google.maps.LatLng(currentLocation['latitude'],
                    currentLocation['longitude']),
                map: WintrustFED.locationMap
            });
            markers.push(myMarker);
            var imhereInfo = '';
            // if viewmap=true, use default marker; otherwise use man icon for you are here marker
            if ($('#location-search-address-zipcode').attr('viewmap') != 'true') {
                myMarker.setIcon('https://maps.gstatic.com/mapfiles/ms2/micons/man.png');
                imhereInfo = '<span>You are here</span>';
            }
            myMarker.addListener('click', function () {
                infowindow.setContent(imhereInfo);
                infowindow.open(WintrustFED.locationMap, myMarker);
            });
            bounds.extend(myMarker.position);

            //now fit the map to the new bounds to show all banks
            WintrustFED.locationMap.fitBounds(bounds);

            //(optional) restore the zoom level after the map is done scaling
            var listener = google.maps.event.addListener(WintrustFED.locationMap, "idle", function () {
                //WintrustFED.locationMap.setZoom(11);
                google.maps.event.removeListener(listener);
            });
        }

        function showSearchResults(results, displayAll) {
            var $itemInfo = $('.location-search-results-list');
            var $itemInfoMobile = $('.location-search-results-list-mobile');

            $itemInfo.empty();
            $itemInfoMobile.empty();

            $.each(results, function (i, item) {
                var itemInfoRow;
                var itemInfoRowMobile;

                var letter = '';
                if (i < 125) { // arbitrary limit, lettering starts at A & ends at DU
                    letter = colName(i).toUpperCase();
                }

                //split into array, to list each on its own line
                if (item.hours) {
                    var HoursArr = item.hours.split(/\r?\n/);
                }
                var servicesArr = [];
                if (item.services && item.services.length) {
                    servicesArr = item.services.split(/\r?\n/);
                }
                var index = i + 1;

                //browser
                var phoneInfoElement = '';
                var hoursInfoElement = '';

                /* Assumes a "well-formed" phone number will always be xxx-xxx-xxxx or (xxx)xxx-xxxx  */
                var isPhoneNumber = /^\(?([0-9]{3})\)?[-. ]?([0-9]{3})[-. ]?([0-9]{4})$/;

                if (item.phone_number && item.phone_number.match(isPhoneNumber)) {
                    phoneInfoElement = '<div class="location-phone"><br/>' +
                        '<a href="tel:' + item.phone_number + '"><i class="fa fa-phone"></i>' + item.phone_number + '</a>' +
                        '</div>';
                }
                if (item.hours) {
                    hoursInfoElement = '<div class="location-hours"><i class="fa fa-clock-o"></i>';
                    $.each(HoursArr, function (i, hoursItem) {
                        hoursInfoElement += hoursItem + '<br/>';
                    });
                    hoursInfoElement += '</div>';
                }

                //For ATM results only, do not display phone numbers or hours, & reposition the remaining info.
                var detailColumnOneWidth = '6';
                var detailColumnTwoWidth = '5';
                var atmSearchMarker = ''
                if (atmSearch && !item.branch_type) {
                    phoneInfoElement = '';
                    hoursInfoElement = '';
                    detailColumnOneWidth = '3';
                    detailColumnTwoWidth = '8';
                    atmSearchMarker = 'atmDetails'
                }

                itemInfoRow = '<div class="row location-result"' + ' id="result-id-' + index + '">' +
                    '<div class="col-xs-1 col-sm-1 col-md-1"><h2>' + letter + '.</h2></div>' +
                    '<div class="location-details  col-xs-' + detailColumnOneWidth + ' col-sm-' + detailColumnOneWidth + ' col-md-' + detailColumnOneWidth + ' ' + atmSearchMarker +'">';

                itemInfoRow += '<a href="#" onclick="google.maps.event.trigger(' + index + ', \'click\'); return false;"><img class="item-logo" src="';
                if (atmSearch && !item.branch_type) {
                    itemInfoRow += (item.logo && item.logo.trim().length > 0) ? 'https://images.locatorsearch.com/' + item.logo : defaultlogo;
                } else {
                    itemInfoRow += (item.fileReference && item.fileReference.trim().length > 0) ? item.fileReference : defaultlogo;
                }
                itemInfoRow += '" alt="' + item.bankImageAltText + '"/></a>';

                itemInfoRow += phoneInfoElement + hoursInfoElement;
                itemInfoRow += '</div>' +
                    '<div class="col-xs-' + detailColumnTwoWidth + ' col-sm-' + detailColumnTwoWidth + ' col-md-' + detailColumnTwoWidth + '">' +
                    '<h2 class="bank-name">' + item.name + '</h2>' +
                    '<i>' + item.distance + ' miles</i><br/>' +
                    item.street_address + '<br/>' +
                    item.city + ' ' + item.zipcode +
                    '<h2>' + 'Services' + '</h2>';
                $.each(servicesArr, function (i, servicesItem) {
                    itemInfoRow += servicesItem + '<br/>';
                });
                itemInfoRow += '</div>' //end col
                    +
                    '</div><hr/>'; //end row

                $itemInfo.append(itemInfoRow);

                //mobile, truncated info (bank name, location, and distance)
                itemInfoRowMobile = '<div class="row">' +
                    '<div class="col-2"><h2>' + letter + '.</h2></div>' +
                    '<div class="location-details  col-10">' +
                    '<b>' + item.name + '</b><br/>' +
                    '<i>' + item.distance + ' miles</i><br/>' +
                    item.street_address + '<br/>' +
                    item.city + ' ' + item.zipcode

                    +
                    '<h3><a class="accordion-toggle" data-toggle="collapse" ' +
                    'href="#details-' + letter + '">View Details</a></h3>' +
                    '<div id="details-' + letter + '" class="panel-collapse collapse">' +
                    '<div class="panel-body">' +
                    '<img class="item-logo" src="' + item.logo + '" alt="' + item.bankImageAltText + '"/>' +
                    phoneInfoElement +
                    hoursInfoElement +
                    '<h2>' + 'Services' + '</h2>';
                $.each(servicesArr, function (i, servicesItem) {
                    itemInfoRowMobile += servicesItem + '<br/>';
                });
                itemInfoRow += '</div>' +
                    '</div>'

                    +
                    '</div>' //end col
                    +
                    '</div><hr/>'; //end row
                $itemInfoMobile.append(itemInfoRowMobile);
                if (!displayAll) {
                    return false;
                }
            });

            $('.row.location-result').off('click').on('click', function () {
                var idArray = this.id.split('-');
                var index = idArray[2] - 1;
                google.maps.event.trigger(markers[index], 'click');
            });
        }

        function sortBankInformation(bankInformations, sortType) {
            if (sortType == 'distance') {
                bankInformations.sort(function (a, b) {
                    var distanceA = parseFloat(a.distance);
                    var distanceB = parseFloat(b.distance);
                    if (distanceA < distanceB) {
                        return -1;
                    }
                    if (distanceA > distanceB) {
                        return 1;
                    }
                    return 0;
                });
            } else {
                bankInformations.sort(function (a, b) {
                    var bankNameA = a.name.toLowerCase();
                    var bankNameB = b.name.toLowerCase();
                    if (bankNameA < bankNameB) {
                        return -1;
                    }
                    if (bankNameA > bankNameB) {
                        return 1;
                    }
                    return 0;
                });
            }
            return bankInformations;
        }
        
        function datalayerLocationSearchEvent(searchTerm, results) {            
            if(searchTerm) {
                searchTerm = searchTerm.toLowerCase().trim();
            }

            var eventDetails = {
                "event": "useLocationSearch",
                "LocationSearch": {
                    "term": searchTerm,
                    "results": results
                }
            };
            WintrustFED.sendComplexDataLayerEvent(eventDetails);
        }        
    }
});
