$(document).ready(function () {
	function clearTabs() {
		$('.megamenu-li').each(function () {
			$(this).removeClass('show');
		});
	}

	function closeMenus() {
		$('.dropdown-menu').each(function () {
			$(this).removeClass('show');
		});
	}

	$('.megamenu-li').each(function (index) {
		$(this).on('click', function () {
			clearTabs();
			$(this).addClass('show');
			var menu = '#dropdown-' + index + '-menu';
			var open = $(menu).hasClass('show');
			if (open) {
				$(menu).removeClass('show');
				clearTabs();
			} else {
				closeMenus();
				$(menu).addClass('show');
			}
			
            $('.menuModalWrapper').find('.modal').each(function(){
                $(this).css('display', 'none');
			});
			$('.top-nav-item').each(function(){
				$(this).removeClass('active');
			});
		});
	});

	$('.mobile-nav-link').on('click', function (e) {
		var closed = $(this).hasClass('collapsed');
		if (closed) {
			$(this).find('.fa').removeClass('fa-plus').addClass('fa-minus');
		} else {
			$(this).find('.fa').removeClass('fa-minus').addClass('fa-plus');
		}
	});

	if ($("#meganav").length) {
		/* When Menu button is clicked in mobile view, show or hide the mobile Meganav menu. See also navmodals html */
		$('.menuShowMeganav').on('click', function () {
			//if menu is showing, hide
			var nav = $('.meganav-mobile');
			if ($(nav).hasClass('d-md-none')) {
				$(nav).removeClass('d-md-none').addClass('d-none');
			} else {
				$(nav).removeClass('d-none').addClass('d-md-none');
			}
		});

		var active = $('a[data-toggle="tab"]').parents('.active').length;
		var tabClicked = false;

		// Closes current active tab (toggle and pane):
		var close = function () {
			$('a[data-toggle="tab"]').parent().removeClass('active');
			$('.tab-pane.active').removeClass('active');
			active = null;
		}

		// Closing active tab when clicking on toggle:
		$('[data-toggle=tab]').on('click', function () {
			if ($(this).parent().hasClass('active')) {
				$($(this).attr("href")).toggleClass('active');
				active = null;
			} else {
				tabClicked = true;
				active = this;
				var tabId = $(this).attr('href');
				var tabIndex = $(this).attr('tabIndex');
				$(tabId).find('a').attr('tabIndex', tabIndex); //set the sub tab elements to the same tab index as header
			}
		});

		// Closing active tab when clicking outside tab context (toggle and pane):
		$(document).on('click.bs.tab.data-api', function (event) {
			if (active && !tabClicked && !$(event.target).closest('.tab-pane.active').length) {
				close();
			}

			tabClicked = false;
		});

		// Closing active tab on ESC key release:
		$(document).on('keyup', function (e) {
			if (active && e.keyCode === 27) { // ESC
				close();
			}
		});

		$('#mobile-searchbox-submit-button').on('click', function () {
			var siteSearchPageUrl = $('#searchbox-submit').data('resultspage');
			var searchTerm = $('#srch-term').val();
			window.location.href = siteSearchPageUrl + '?searchterm=' + searchTerm;
		});
	}
});
