                            /*ajax.data['location'] = {
                                'longitude': responseInfo.location.lng,
                                'latitude': responseInfo.location.lat
                            };*/
                            location = {
                                'longitude': responseInfo.location.lng,
                                'latitude': responseInfo.location.lat
                            }
                            ajax.data['longitude'] =responseInfo.location.lng;
                            ajax.data['latitude'] = responseInfo.location.lat;
