$(function () {
    var heroCarousel = $('#hero-carousel');

    //updating carousel settings during load
    heroCarousel.carousel ({
        pause: "false"
    });

    if (heroCarousel.length) {
        heroCarousel.find('.btn.primary-btn').on('click', function () {
            var url = $(this).data('click-target');
            var tld = false;
            var pattern = /^(?:http(s)?:\/\/)?[\w.-]+(?:\.[\w\.-]+)+[\w\-\._~:/?#[\]@!\$&'\(\)\*\+,;=.]+$/;
            if(pattern.test(url)){
                tld = true;                
            }
            if (typeof url !== 'undefined' && url !== null) {
                if (tld) {
                    window.location.href = url;
                } else {
                    window.location.href = url + (url.indexOf('.html') < 0 ? '.html' : '');
                }
            }
        });
    }

    //After the carousel finishes the transition slide update the prev/next button captions
    $('.carousel').on('slid.bs.carousel', function (e) {
        var carouselId = $(this).attr('id');
        var totalSlides = 0;
        var activeSlide = 0;
        var prevLabel = $('#' + carouselId + '-prev').data("prev-label");
        var nextLabel = $('#' + carouselId + '-next').data("next-label");
        $('#' + carouselId + ' .carousel-indicator-li').each(function () {
            totalSlides++;
            if ($(this).hasClass('active')) {
                activeSlide = totalSlides;
            }
        });
        var previousSlide = activeSlide - 1;
        if (parseInt(previousSlide) == 0) { //goes to the end
            previousSlide = totalSlides;
        }
        var nextSlide = activeSlide + 1;
        if (nextSlide > totalSlides) { //goes to the first
            nextSlide = 1;
        }
        $('#' + carouselId + '-prev').attr('aria-label', prevLabel + ' (' + previousSlide + ' of ' + totalSlides + ')');
        $('#' + carouselId + '-next').attr('aria-label', nextLabel + ' (' + nextSlide + ' of ' + totalSlides + ')');
    });

    //On the carousel bullet slide indicator - move the visual indicator and slide content
    $('.carousel-indicator-btn').on('focus', function () {
        var carouselId = $(this).closest('.carousel').attr('id');
        var slideId = $(this).attr('slideIndex');
        $('.carousel-indicator-li').removeClass('active');
        $(this).closest('li').addClass('active');
        $('#' + carouselId).carousel(parseInt(slideId));
    });

    //Increments each slide index by one so it's more readable by screen readers (1, 2, 3 instead of 0, 1, 2)
    $('.friendly-slide-number').each(function () {
        var friendlyNumber = parseInt($(this).html());
        friendlyNumber++;
        $(this).html(friendlyNumber);
    });

    //Loop through each carousel and find the count of slides and update the descriptive total span
    $('.carousel').each(function () {
        var carouselSlideCount = $(this).find('.carousel-indicator-li').length;
        $(this).find('.friendly-slide-total').html(carouselSlideCount);
    });

    if ($('.herocarousel').length) {
        if ($('.hero-carousel-caption').length) {
            $('.hero-carousel-caption').each(function () {
                if ($(this).hasClass('turquoise') || $(this).hasClass('salmon')) {
                    $(this).children('p').remove();
                    $(this).children('button').remove();
                }
            });
        }
    }

});

