function resizeCarouselText() {
    var maxFontPixels = 50;
    var minFontPixels = 0;
    var fontSize = maxFontPixels;
    var maxHeight = $('.carousel-item.active .hero-carousel-caption').height();

    var textHeight;
    do {
        $('.carousel-item.active h1').css('font-size', fontSize);
        textHeight = $('.carousel-item.active h1').outerHeight(true) + $('.carousel-item.active p').outerHeight(true) + $('.carousel-item.active button').outerHeight(true);
        fontSize = fontSize - 1;
    } while (textHeight > maxHeight && fontSize > minFontPixels);
}

