$(function() {

    var newsWidget = $('.js-newswidget');
    if (newsWidget.length) {

        /* For each container-fluid (each row of 2), make all .items the height of the tallest .item
         *    First, for each item in newswidget1 and newswidget2 (1st container-fluid).
         *    Then, for each item in newswidget3 and newswidget4 (2nd container-fluid).
         */
        var maxItemHeight = 0;
        newsWidget.find('.container-fluid').each(function() {
            var carouselInner = $(this).find('.carousel-inner');
            carouselInner.each(function() {
                var height = $(this).height();
                maxItemHeight = maxItemHeight > height ? maxItemHeight : height;
            });
            carouselInner.each(function() {
                $(this).height(maxItemHeight);
            });
        });

        /* Mobile view: onclick of an accordion item, show that newswidget (1, 2, 3, or 4) */
        var newsWidget1 = newsWidget.find('#newswidget1');
        var newsWidget2 = newsWidget.find('#newswidget2');
        var newsWidget3 = newsWidget.find('#newswidget3');
        var newsWidget4 = newsWidget.find('#newswidget4');

        $('#category1Name').on('click', function() {
            newsWidget2.hide().parent().hide();
            newsWidget3.hide().parent().hide();
            newsWidget4.hide().parent().hide();
            newsWidget1.show().parent().show();
        });
        $('#category2Name').on('click', function() {
            newsWidget1.hide().parent().hide();
            newsWidget3.hide().parent().hide();
            newsWidget4.hide().parent().hide();
            newsWidget2.show().parent().show();
        });
        $('#category3Name').on('click', function() {
            newsWidget1.hide().parent().hide();
            newsWidget2.hide().parent().hide();
            newsWidget4.hide().parent().hide();
            newsWidget3.show().parent().show();
        });
        $('#category4Name').on('click', function() {
            newsWidget1.hide().parent().hide();
            newsWidget2.hide().parent().hide();
            newsWidget3.hide().parent().hide();
            newsWidget4.show().parent().show();
        });

        /* Resize functions */
        $(window).on('resize', function() {
            mobileCheck();
        });

        function mobileCheck() {
            /* assumes we don't have to support IE9.  If we do ->  if (Modernizr.mq('(max-width: 991px)'))  */
            if (window.matchMedia('(max-width: 991px)').matches) {
                //  IF and ONLY IF widget 1 is showing, hide other col-md's to avoid gap between carousel & accordion items
                if (newsWidget1.is(':visible')) {
                    newsWidget2.parent().hide();
                    newsWidget3.parent().hide();
                    newsWidget4.parent().hide();
                }
            } else {
                //  if browser, show all items again
                newsWidget1.show().parent().show();
                newsWidget2.show().parent().show();
                newsWidget3.show().parent().show();
                newsWidget4.show().parent().show();
            }
        }

        mobileCheck();
        
        $( ".news-widget-btn" ).on( "click", function() {
        	var destinationPage = $(this).data("click-target");
        	window.location.href = destinationPage;
        });
    }

});

$(function() {

    var newsCarousel = $('.js-newscarousel');
    if (newsCarousel.length) {

        var numItemsShowing = 3;
    	//onload or on resize, if the screen is mobile, numItemsShowing = 1.
    	$(window).on('resize', function() {
    		/* assumes we don't have to support IE9.  If we do ->  if (Modernizr.mq('(max-width: 767px)'))  */
            numItemsShowing = (window.matchMedia('(max-width: 767px)').matches) ? 1 : 3;
    	});

        var carousel = $('#newswidget1');

        carousel.carousel({interval: false});
        carousel.find('.item').each(function() {
            var itemToClone = $(this);

            for (var i = 1; i < numItemsShowing; i++) {

                itemToClone = itemToClone.next();

                // wrap around if at end of item collection
                if (!itemToClone.length) {
                    itemToClone = $(this).siblings(':first');
                }
                // grab item, clone, add marker class, add to collection
                itemToClone.children(':first-child').clone()
                    .addClass("cloneditem-" + (i))
                    .appendTo($(this));
            }
        });

    }

});

