            '<div class="event-rsvp"><a data-toggle="modal" href="#" data-load-url="{{rsvpPath}}.rsvpform.html" data-target="#rsvpModal"><i class="fa fa-pencil-square-o"></i>' + eventRsvp + '</a></div>' +
            '{{/if}}' +
            '<div class="event-add-to-cal" data-path="{{path}}"><a href="#"><i class="fa fa-calendar-plus-o"></i><span>' + eventAddToCal + '</span></a></div>' +
            '</div></div>{{/events}}';

        var eventTemplate = Handlebars.compile(eventItem);

        initGeoLocation();

        function initGeoLocation() {
            try {
                geocode = (typeof navigator.geolocation === 'undefined') ? google.gears.factory.create('beta.geolocation') : navigator.geolocation;
            } catch (e) {
                // do nothing
            }
        }

        if (geocode) {
            geocode.getCurrentPosition(
                function (data) {
                    searchCriteria.useLocation = true;
                    searchCriteria.currLocation = {
                        long: data.coords.longitude,
                        lat: data.coords.latitude
                    };
                    searchedByLatLong = true;
                    updateResults();
                    updateEvents();
                },
                function (error) {
                    getLocationByGoogleApi();
                    if (error.code == 1) {
                        console.error('error #1: ' + 'permission denied message from geolocation service');
                    } else if (error.code == 2) {
                        console.error('error #2: ' + 'geolocation service could not find location');
                    } else if (error.code == 3) {
                        console.error('error #3: ' + 'timeout while connecting geolocation service');
                    } else {
                        console.error('error #4: ' + 'error');
                    }
                    searchCriteria.useLocation = false;
                    searchedByLatLong = false;
                    updateResults();
                    updateEvents();

                },
                {
                    timeout:5000
                }
            );
        } else {
            searchedByLatLong = false;
            updateResults();
            updateEvents();
        }

        function getLocationByGoogleApi() {
            var referrer = $(location).attr('host');
            var googleMapsGeoLocationApiUrl = 'https://www.googleapis.com/geolocation/v1/geolocate?key=AIzaSyCF38reM2D4yceqQ01YczuNkiIm76fDu2A';
            $.ajax({
                'url': googleMapsGeoLocationApiUrl,
                'dataType': 'json',
                'async': true,
                method: 'POST',
                beforeSend: function (xhr) {
                    xhr.setRequestHeader('X-Alt-Referer', referrer);
                },
                contentType: 'application/json;charset=UTF-8',
                success: function (data, textStatus, jqXHR) {
                    if (data.error) {
                        isFinding = false;
                        return;
                    }
                    if (data.location) {
                        searchCriteria.useLocation = true;
                        searchCriteria.currLocation = {
                            'long': data.location.lng,
                            'lat': data.location.lat
                        };
                        searchedByLatLong = true;
                        if (search.page === 0) {
                            updateResults();
                        }

                        updateEvents();
                    }
                },
                error: function (response) {
                    searchCriteria.useLocation = false;
                    searchedByLatLong = false;
                    updateEvents();
                    console.error('Unable to retrieve location.');
                }
            });
        }

        /**
         * Create pagination for the search results
         */
        function paginate() {
            $('#article-search-result-row').find('.pager').remove();
            var isMobile = ($(window).width() < 769);
            var currentPage = 0;
            var numPerPage = 3;
            if (!isMobile) {
                var numPerPage = resultsPerPage;
            }
            var articleResult = $('.article-result');
            var numRows = articleResult.find('.article-wrapper.paginate').length;
            var numPages = Math.ceil(numRows / numPerPage);
            articleResult.on('repaginate', function () {
                articleResult.find('.article-wrapper').hide();
                articleResult.find('.article-wrapper.paginate').hide().slice(currentPage * numPerPage, (currentPage + 1) * numPerPage).show();

                if (!isMobile) {
                    if (doScroll) {
                        $('html, body').animate({
                            scrollTop: articleSearchContainer.offset().top
                        }, 500);
                    } else {
                        doScroll = true;
                    }
                }
                if (!isMobile) {
                    showSearchKeyword();
                }
            });
            articleResult.trigger('repaginate');

            if (numPages > 1) {
                if (isMobile) {
                    var moreButton = $('<div class="mobile-show-more"></div>')
                        .append('<button id="mobile-show-more" class="btn primary-btn"><h3>Show More</h3></button>')
                        .on('click', function () {
                            numPerPage += 3;
                            articleResult.trigger('repaginate');
                            if (numPerPage >= (3 * numPages)) {
                                $(this).hide(); // no more results to show- hide 'Show More' button
                            }
                            $('.page-number').each(function () {
                                var currPageNum = $(this);
                                var tmpPgNum = parseInt(currPageNum.text());
                                if (tmpPgNum <= (currentPage + 1)) {
                                    currPageNum.addClass('active');
                                } else {
                                    currPageNum.removeClass('active');
                                }
                            });
                        });
                    $("#search-results").append(moreButton);

                    // Pagination Change start
                } else {
                    pageNumbers();
                }
            }
            WintrustFED.dotdotdot.init();

            function prevPageNumber(resultsPager) {
                $('<div class="previous"></div>').append('<h3><a href="#" onclick="return false;">' + prevPaginateText + '</a></h3>').on('click', function (event) {
                    if (currentPage > 0) {
                        currentPage--;
                    } else {
                        currentPage = numPages - 1;
                    }
                    articleResult.trigger('repaginate');
                    pageNumbers();
                    $('.page-number').each(function () {
                        var currPageLink = $(this);
                        var tmpPgNum = parseInt(currPageLink.text());
                        if (tmpPgNum === (currentPage + 1)) {
                            currPageLink.addClass('active');
                        } else {
                            currPageLink.removeClass('active');
                        }
                    });
                }).appendTo(resultsPager);
                return resultsPager;
            }

            function nextPageNumber(resultsPager) {
                $('<div class="next"></div>').append('<h3><a href="#" onclick="return false;">' + nextPaginateText + '</a></h3>').on('click', function () {
                    if (currentPage + 1 < numPages) {
                        currentPage++;
                    } else {
                        currentPage = 0;
                    }
                    articleResult.trigger('repaginate');
                    pageNumbers();
                    $('.page-number').each(function () {
                        var currPageLink = $(this);
                        var tmpPgNum = parseInt(currPageLink.text());
                        if (tmpPgNum === (currentPage + 1)) {
                            currPageLink.addClass('active');
                        } else {
                            currPageLink.removeClass('active');
                        }
                    });
                }).appendTo(resultsPager);
                return resultsPager;
            }

            function pageNumbers() {
                var resultsPager = $('<div class="pager"></div>');
                resultsPager = prevPageNumber(resultsPager);
                // Determines what page #s to be displayed
                var page;
                var endPage;
                if (currentPage < 4) {
                    page = 0;
                    if (numPages < 10) {
                        endPage = numPages;
                    } else {
                        endPage = 10;
                    }
                } else if (numPages < 10) {
                    page = 0;
                    endPage = numPages;
                } else if (currentPage > numPages - 6) {
                    page = numPages - 10;
                    endPage = numPages;
                } else {
                    page = currentPage - 4;
                    endPage = currentPage + 6;
                }
                for (page; page < endPage; page++) {
                    $('<div class="page-number"></div>').append('<h3><a href="#" onclick="return false;">' + (page + 1) + '</a></h3>').on('click', {
                        newPage: page
                    }, function (event) {
                        currentPage = event.data['newPage'];
                        articleResult.trigger('repaginate');
                        pageNumbers();
                        $('.page-number').each(function () {
                            var currPageLink = $(this);
                            var tmpPgNum = parseInt(currPageLink.text());
                            if (tmpPgNum === (currentPage + 1)) {
                                currPageLink.addClass('active');
                            } else {
                                currPageLink.removeClass('active');
                            }
                        });
                    }).appendTo(resultsPager).addClass('clickable');
                }

                resultsPager = nextPageNumber(resultsPager);

                $('#article-search-result-row').find('.pager').remove();
                resultsPager.insertAfter(articleResult).find('div.page-number:first').addClass('active');
            }
        } // Pagination Change end

        //Enter Key fix
