        // Updating the search keyword value onBlur event - WA - 1035
        // If the search keyword is cleared, results should be updated automatically without enter key press/search icon click
        $(".js-searchbox-input").on('blur', function () {
            if (event.target.value !== searchCriteria.keyword && event.target.value == '') {
                searchCriteria.keyword = $('#keyword-input').val();
                updateResults();
            }
        });

        /**
         * Event handler for the keyword search input
         */
        $('#search-keyword-button').on('click', function () {
            searchCriteria.keyword = $('#keyword-input').val();
            updateResults();
        });

