$(function() {
    window.WintrustFED = window.WintrustFED || {};
    WintrustFED.setCookieValue = WintrustFED.setCookieValue || function(cookieName, cookieValue) {
        document.cookie = cookieName + "=" + cookieValue + ";path=/";
    }

    var profile = $('.js-profile');
    if (profile.length) {
        if ($(".profile-image").data('searchpath') && $(".profile-image").data('searchpath')!='.html') {
			$(".profile-image").css('cursor','pointer');
        }

        // Expert data to cookie
        var firstName = $("#expertXFFirstName").val();
        var lastName = $("#expertXFLastName").val();
        if (!firstName || !lastName) {
            firstName = lastName = "";
        }

        WintrustFED.setCookieValue("LOFirstName", firstName);
        WintrustFED.setCookieValue("LOLastName", lastName);

        //submit search term to search results page
        $(".profile-image").on('click', function () {
            var expertSearchPageUrl = $(this).data('searchpath');//"/content/wintrust/en/find-expert.html"
            if(expertSearchPageUrl && expertSearchPageUrl!='.html'){
                var expertName = $(this)[0].nextElementSibling.innerText;//$(".profile-name").innerText;
                var expertsearchUrlWithArgs = expertSearchPageUrl + "?expert=" + expertName;
                window.location.href = expertsearchUrlWithArgs;
            }
        });

        //Find NMLS number if present for the calculator pages to use
        //If not found, unset it so that it's not persisting from a different expert
        var credentials = $("#expertXFCredentials").val();
        var nmls = "";
        if (credentials) {
            var sp = credentials.split(" ");
            for (var i = 0; i < sp.length; i++) {
                var part = sp[i];
                if (part[0] == "#") {
                    //#1234 as 1234
                    nmls = part.substring(1, part.length);
                    break;
                }
            }
        }
        nmls = nmls || "";

        //Has to be set as a query parameter to be used across origins 
        var mcLink = document.querySelector('a[title="Mortgage Calculator"]');
        if (mcLink) {
            mcLink.href += (mcLink.href.indexOf("?") == -1 ? "?" : "&") + "nmls=" + nmls;
        }
    }
});

$(function() {

    var pageCarousel = $('.pagecarousel');
    if (pageCarousel.length) {

    	var numItemsShowing = 3;
    	//onload or on resize, if the screen is mobile, numItemsShowing = 1.
    	$(window).on('resize', function() {
    		/* assumes we don't have to support IE9.  If we do ->  if (Modernizr.mq('(max-width: 767px)'))  */
            numItemsShowing = (window.matchMedia('(max-width: 767px)').matches) ? 1 : 3;
    	});

        var carousel = $('#page-carousel');

        carousel.carousel({interval: false});
        carousel.find('.carousel-item').each(function() {
            var itemToClone = $(this);

            for (var i = 1; i < numItemsShowing; i++) {

                itemToClone = itemToClone.next();

                // wrap around if at end of item collection
                if (!itemToClone.length) {
                    itemToClone = $(this).siblings(':first');
                }
                // grab item, clone, add marker class, add to collection
                itemToClone.children(':first-child').clone()
                    .addClass("cloneditem-" + (i))
                    .appendTo($(this));
            }
        });

    }

});

