$(function() {
if($('.affinitycontact').length > 0){
    function validCaptcha() {
        for (var i = 0; i < window.___grecaptcha_cfg.count; i++) {
            var response = grecaptcha.getResponse(i);
            if (response.length) {
                return true;
            }
        }
        return false;
    }
    
    if($("#contactgenericModal").length || $("#contactgeneric").length){
        var form = $('#contactgenericform');

    $(document).ajaxStart(function(){
        form.hide();
        $("#submit").attr("disabled","disabled");
    });

    var validationErrors=[];

    $('#viewModal').on('click', function (event) {
        $("#contactgeneric").modal("show");
    });


    $(document).on('click', '#submit', function(e) {
        e.preventDefault();
        form = $('#contactgenericform');
        var validationErrors = [];
        $("span.error").remove();

        form.find('input,textarea,select').each(function() {
            var currInput = $(this);
            var inputParent = $(this).parent();
            var nameFromElement = $(this).attr("name");
            var valueFromElement = $(this).val();
            if (inputParent.data("required") === "Yes") {
                if ((this.tagName == 'SELECT' && this.value == 'default')) {
                    valueFromElement = null;
                }
                if (!valueFromElement) {
                    validationErrors.push("error");
                    if (!$(this).parent().find("span.error").length) {
                        $(this).after('<span class="error">Required Value *</span>');
                    }
                }

            }

            var validationType = inputParent.data('validation');
            if (validationType === "emailvalidation") {
                if (valueFromElement.length > 0 && !validateEmail(valueFromElement)) {
                    validationErrors.push("error");
                    if (!$(this).parent().find("span.error").length)
                        $(this).after('<span class="error">Please enter a valid Email Address.</span>');
                }

            }
            if (validationType === "numericonly") {
                if (valueFromElement.length > 0 && !isNumber(valueFromElement)) {
                    validationErrors.push("error");
                    if (!$(this).parent().find("span.error").length)
                        $(this).after('<span class="error">Entry must be numeric</span>');
                }

            }
            if (validationType === "alphaonly") {
                if (valueFromElement.length > 0 && !isAlpha(valueFromElement)) {
                    validationErrors.push("error");
                    if (!$(this).parent().find("span.error").length)
                        $(this).after('<span class="error">Entry must be numeric</span>');
                }
            }
        });

        form.find('input[type=checkbox]:checked, input[type=radio]:checked').each(function() {
            var nameChecked = $(this).attr("name");
            var valueChecked = $(this).val();
            if ($(this).parent().data("required") === "Yes") {
                if (!valueChecked) {
                    validationErrors.push("error");
                    if (!$(this).parent().find("span.error").length)
                        $(this).after('<span class="error">Required Value *</span>');
                }
            }
        });

        var captcha = form.find(".g-recaptcha");
        if (captcha.length > 0) {
            if (!validCaptcha()) {
                $('#recaptcha-error').show();
                validationErrors.push("error");
                captcha.after('<span id="captcha-error-msg" class="error">Please complete the captcha</span>');
            }
            else {
                $("#captcha-error-msg").remove();
            }

        }
        if (validationErrors.length < 1) {
            e.preventDefault();
            var data = {};
            var inputs3 = form.serializeArray();
            $.each(inputs3, function(index, value) {
                var nameVar = inputs3[index].name;
                data[nameVar] = value.value;
            });
            data["path"] = $("#dynamicModalContent").data("form-path");
            data["formType"] = 5;
            data["formDisplayName"] = "Affinity Contact";
            data["siteDomain"] = window.location.href;
            data["headerDescription"] = $("#dynamicModalContent").data("header-description");
           	data["footerDescription"] = $("#dynamicModalContent").data("footer-description");
            var successMsg = $("#dynamicModalContent").data("success-message");
            var formTitle = $("#dynamicModalContent").data("form-title");
            var analyticsEnabled = $("#dynamicModalContent").data("analytics-enabled");
            $.ajax({
                type: 'GET',
                url: '/bin/wintrust/forms/contactus',
                data: data,
                success: function(msg) {
                    if (analyticsEnabled === 'YES' && typeof _satellite !== 'undefined') {
                        _satellite.track("contactgeneric_success");
                    }
                    //display the data returned by the servlet
                    $(".modal").each(function() {
                        if ($(this).attr("id") === "contactgenericModalSuccess") {
                            $(this).modal("show").addClass("fade");
                            $("#successModalLabel").html(formTitle);
                            $("#successMessage").html(successMsg);
                        } else {
                            $(this).removeClass("fade").modal("hide");
                        }
                    });

                }
            });
        }
    });

    function validateEmail(email) 
    {
        var re = /\S+@\S+\.\S+/;
        return re.test(email);
    }

    function isNumber(n) {
              return $.isNumeric(n);
    }

    function isAlpha(n) {
        return !/.*[0-9].*/.test(n);
    }

            function hasValue(n){
                    return !n.val();
            }
    }

}	
});

