$(function() {
  var notificationInstance = $('.js-cmp-notification');
  if (notificationInstance.length) {
    // Creating new Vue js instance for notification
    var notification = new Vue({
      el: '.js-cmp-notification',
      data: {
        domainName: document.domain,
        showNotification: false,
        ineligibleDomain: [],  // array to store multiple doamin names
        legalBankName: ''
      },
      mounted: function () {
        // get the legal bank name and replace the data token
        this.legalBankName = $('div[data-lastmodified]').attr('data-legal-bank-name');
        // set dafault bank name to 'Wintrust Financial Services Company' if backend returns empty bank name
        this.legalBankName = (typeof this.legalBankName !== 'undefined' && this.legalBankName !== '') ? this.legalBankName : 'Wintrust Financial Services Company';
        // get last modified date and comapre with cookie value
        // if current modified date value is greater than cookie value
        // update happened to the notification
        // Then, clear the domain name from ineligible domain cookie value
        let currentModifiedDateString = $('div[data-lastmodified]').attr('data-lastmodified');
        if(currentModifiedDateString !== '') {
          let currentModifiedDate = new Date(currentModifiedDateString).toUTCString();
          this.lastModifiedDate = this.getCookieValue('lastModifiedDate');
          if (currentModifiedDate > this.lastModifiedDate && this.lastModifiedDate !== '') {
            this.deleteCookieValue('ineligibleDomainName', this.domainName);
            this.setCookieValue('lastModifiedDate', currentModifiedDate);
          } else if (this.lastModifiedDate === '') {
            this.setCookieValue('lastModifiedDate', currentModifiedDate);
          }
        }

        // check if domainName is in ineligible domainName list from cookie
        if(this.getCookieValue("ineligibleDomainName") !== "") {
          this.ineligibleDomain = this.getCookieValue("ineligibleDomainName").split(',');
        }
        if (this.ineligibleDomain.length !== 0) {
          for ( let i=0; i<= this.ineligibleDomain.length; i++) {
            if(this.domainName === this.ineligibleDomain[i]) {
              this.showNotification = false;
            }
          }
        } else {
          this.showNotification = true;
        }
      },
      methods: {
        // sets cookie value
        setCookieValue: function (cookieName, cookieValue) {
          document.cookie = cookieName + "=" + cookieValue;
        },
        // returns cookie value
        getCookieValue: function (cookieName) {
          cookieName = cookieName + "=";
          let decodedCookie = decodeURIComponent(document.cookie).split(';');
          for(let i = 0; i < decodedCookie.length; i++) {
            let cookieSubString = decodedCookie[i];
            while (cookieSubString.charAt(0) == ' ') {
              cookieSubString = cookieSubString.substring(1);
            }
            if (cookieSubString.indexOf(cookieName) === 0) {
              let cookieSubStringArray = cookieSubString.split('=');
              return cookieSubStringArray[1];
            }
          }
          return "";
        },
        // delete cookie value
        deleteCookieValue: function (cookieName, cookieValue) {
          cookieName = cookieName + "=";
          let decodedCookie = decodeURIComponent(document.cookie).split(';');
          for(let i = 0; i < decodedCookie.length; i++) {
            let cookieSubString = decodedCookie[i];
            while (cookieSubString.charAt(0) === ' ') {
              cookieSubString = cookieSubString.substring(1);
            }
            if (cookieSubString.indexOf(cookieName) === 0) {
              let cookieSubStringArray = cookieSubString.split('=');
              let domainString = cookieSubStringArray[1].split(',');
              let index = domainString.indexOf(this.domainName);
              domainString.splice(index, 1);
              this.setCookieValue("ineligibleDomainName", domainString.join(','));
            }
          }
        },
        // close button click - event handler
        // update the ineligible site domain and notification closed flag
        closeNotification: function () {
          this.showNotification = false;
          this.ineligibleDomain.push(this.domainName);
          this.setCookieValue("ineligibleDomainName", this.ineligibleDomain.join(','));
        },
        // minimize notification event handler
        minimizeNotification: function () {
          this.showNotification = false;
        }
      }
    });
  }
});
