function processUpload(upload) {
    var form = upload;
    while (form && form.tagName != "FORM") {
        form = form.parentElement;
    }
    if (!form) {
        console.error("Could not find parent form for file upload");
        console.error(upload);
        return;
    }

    var formMaxFileSizeMB = 0;
    if (form.dataset.maxFileSize) {
        formMaxFileSizeMB = parseInt(form.dataset.maxFileSize);
    }
    // console.log("formMaxFileSizeMB: " + formMaxFileSizeMB);

    var invalidFileMessage = "Invalid file";
    if (upload.dataset.invalidFileMessage) {
        // console.log("found invalidFileMessage on upload");
        invalidFileMessage = upload.dataset.invalidFileMessage;
    } else if (form.dataset.invalidFileMessage) {
        // console.log("found invalidFileMessage on container");
        invalidFileMessage = form.dataset.invalidFileMessage;
    }

    var filesizeExceededMessage = "You have exceeded the maximum total file size";
    if (upload.dataset.filesizeExceededMessage) {
        // console.log("found filesizeExceededMessage on upload");
        filesizeExceededMessage = upload.dataset.filesizeExceededMessage;
    } else if (form.dataset.filesizeExceededMessage) {
        // console.log("found filesizeExceededMessage on container");
        // console.log(upload);
        filesizeExceededMessage = form.dataset.filesizeExceededMessage;
    }

    function getFormTotalFileSize() {
        var ret = 0;
        var uploads = form.querySelectorAll(".winui-form-upload");
        // console.log("uploads: " + uploads.length);
        for (var i = 0; i < uploads.length; i++) {
            // console.log(uploads[i].dataset.fileSize);
            if (uploads[i].dataset.fileSize) {
                ret += parseInt(uploads[i].dataset.fileSize);
            }
        }
        return ret;
    }

    function show(wrapper, show) {
        if (!wrapper) {
            return;
        }
        if (show === undefined) {
            show = true;
        }
        if (show) {
            wrapper.classList.remove("display-none");
        } else {
            wrapper.classList.add("display-none");
        }
    }
    function makeUploadValidate(dropzone, required) {
        return function() {
            if (required && dropzone.files.length == 0) {
                return false;
            }
            return true;
        }
    }
    function makeAddedFile(dropzoneInput, successWrapper, errorWrapper, requiredLabel, spinner) {
        return function(file) {
            window.dzfile = file;
            show(spinner);

            // console.log(upload);

            upload.dataset.fileSize = 0;

            var reader = new FileReader();

            reader.onload = function() {
                show(spinner, false);
            
                function fail(message) {
                    errorWrapper.innerText = message;
                    show(errorWrapper);
                    show(requiredLabel);
                    show(successWrapper, false);
                }
                
                if (!file.accepted) {
                    fail(invalidFileMessage);
                    return;
                }

                // 1.37 for base64
                var fileSizeMB = reader.result.length / 1370000;
                if (formMaxFileSizeMB && getFormTotalFileSize() + fileSizeMB > formMaxFileSizeMB) {
                    fail(filesizeExceededMessage);
                    return;
                }

                upload.dataset.fileSize = fileSizeMB;

                window.refreshWinuiFormButtons();

                dropzoneInput.value = filterFilename(file.name) + "|" + reader.result;

                show(successWrapper);
                show(errorWrapper, false);
                successWrapper.innerText = file.name;
                show(requiredLabel, false);
            };

            reader.onerror = function() {
                console.error(reader.error);

                show(spinner, false);

                window.refreshWinuiFormButtons();
            
                show(successWrapper, false);
                show(errorWrapper);
                errorWrapper.innerText = reader.error;
                show(requiredLabel);
            };

            reader.readAsDataURL(file);
        }
    }

    function makeRemoveFile(dropzoneInput, requiredLabel) {
        return function() {
            dropzoneInput.value = "";
            show(successWrapper, false);
            show(requiredLabel);
        }
    }

    function makeUploadProgress(spinner) {
        return function(progress) {
            // console.log(progress);
            show(spinner, progress < 100);
        }
    }

    function makeUploadIsBlank(input) {
        return function() {
            return !!input.length;
        }
    }

    var dropzoneInput = upload.querySelector(".upload-hidden");
    var dropzoneWrapper = upload.querySelector(".upload-wrapper");
    var successWrapper = upload.querySelector(".upload-success");
    var errorWrapper = upload.querySelector(".upload-error");
    var input = upload.querySelector("input");
    input.isBlank = makeUploadIsBlank(input);
    var requiredLabel = upload.querySelector(".js-required-text");
    var spinner = upload.querySelector(".upload-spinner");

    successWrapper.addEventListener("click", makeRemoveFile(dropzoneInput, requiredLabel));

    function filterFilename(filename) {
        var allowed = "1234567890qwertyuiopasdfghjklzxcvbnmQWERTYUIOPASDFGHJKLZXCVBNM-_,.";

        var ret = "";
        for (var i = 0; i < filename.length; i++) {
            if (allowed.indexOf(filename.charAt(i)) > -1) {
                ret += filename.charAt(i);
            }
        }

        return ret;
    }

    var config = {
        autoProcessQueue: false,

        addedfile: makeAddedFile(dropzoneInput, successWrapper, errorWrapper, requiredLabel, spinner),

        method: "post",
        url: "#"
    };
    if (input.hasAttribute("data-accepted-files")) {
        config.acceptedFiles = input.dataset.acceptedFiles;
    }
    var myDropzone = new Dropzone(dropzoneWrapper, config);
    myDropzone.on("uploadprogress", makeUploadProgress(spinner));

    window.dz = myDropzone;

    input.validate = makeUploadValidate(myDropzone, input.hasAttribute("data-required"));

}

function processWinuiFormUploads() {
    // console.log("processWinuiFormUploads");

    var uploads = document.querySelectorAll(".winui-form-upload");
    for (var i = 0; i < uploads.length; i++) {
        processUpload(uploads[i]);

        //upload.validate = makeValidate(captchas[i]);
    }
}

window.processWinuiFormFunctions.push(processWinuiFormUploads);

