function processWinuiFormMDM() {
    function getForm(input) {
        var form = input;
        while (form && form.tagName != "FORM") {
            form = form.parentElement;
        }
        if (!form) {
            console.error("Could not find container form for:");
            console.log(input);
        }
        return form;
    }
    window.mdmInputCheck = function(input) {
        return input.value.length != input.max;
    }

    function showError(container, visible) {
        var errorContainer = container.querySelector(".mdm-error");
        showElement(errorContainer, visible);
    }
    function showTryAgain(container, visible) {
        var tryAgainContainer = container.querySelector(".mdm-try-again");
        showElement(tryAgainContainer, visible);
    }
    function showSuccess(container, visible) {
        var successContainer = container.querySelector(".mdm-success");
        showElement(successContainer, visible);
    }
    function showSpinner(container, visible) {
        var spinnerContainer = container.querySelector(".mdm-spinner");
        showElement(spinnerContainer, visible);
    }
    function showElement(element, visible) {
        if (visible === undefined) {
            visible = true;
        }
        
        if (visible) {
            element.classList.remove("display-none");
        } else {
            element.classList.add("display-none");
        }
    }

    function clickListener(container, btn) {
        return function () {
            var formContainer = getForm(container);

            var endpoint = btn.dataset.endpoint;

            var ssn = container.querySelector('input[name="mdm-ssn-entry"]').value;
            var tin = container.querySelector('input[name="mdm-tin-entry"]').value;

            var accountNumber = container.querySelector('input[name="mdm-account-entry"]').value;
            var businessLoan = container.querySelector('input[name="mdm-business-loan-entry"]').value;
            var dda = container.querySelector('input[name="mdm-dda-entry"]').value;

            var submitData = { };

            switch (btn.dataset.mdmSubmit) {
                case "ssn":
                    submitData = {
                        isIndividual: true,
                        tinId: ssn,
                        accountNumber: accountNumber
                    };
                    break;
                case "dda":
                    submitData = {
                        tinId: tin,
                        isIndividual: false,
                        ddaNumber: dda
                    };
                    break;
                case "business-loan":
                    submitData = {
                        tinId: tin,
                        isIndividual: false,
                        loanNumber: businessLoan
                    };
                    break;
            }

            showSuccess(container, false);
            showError(container, false);
            showTryAgain(container, false);
            showSpinner(container);

            var debugSuccess = false;
            var debugTimeout = false;
            var debugError = false;
            var debugThrow = false;

            if (window.WintrustFED) {
                debugSuccess = WintrustFED.hasQueryParam("mdmSuccess");
                debugTimeout = WintrustFED.hasQueryParam("mdmTimeout");
                debugError = WintrustFED.hasQueryParam("mdmError");
                debugThrow = WintrustFED.hasQueryParam("mdmThrow");
            }

            function makeSuccess(container, throwException) {
                return function(data) {
                    try {
                        if (throwException) {
                            throw 'mdm debug test exception';
                        }

                        console.log("data:");
                        console.log(data);

                        if (data !== null) {
                            //got data
                            showSuccess(container);

                            Object.keys(data).forEach(function(name) {
                                var value = data[name];
                                // Don't overwrite inputs with blank values
                                if (value && value.trim()) {
                                    var matches = formContainer.querySelectorAll('input[name="' + name + '"]');
                                    for (var i = 0; i < matches.length; i++) {
                                        matches[i].value = value;
                                        // console.log("mdm: setting " + name + " to " + value);
                                        //IE doesn't support InputEvent
                                        if (matches[i].inputEvent) {
                                            matches[i].inputEvent();
                                        }
                                    }
                                }
                            });

                            container.completed = true;
                        } else {
                            //invalid customer data
                            console.log("null data from MDM call");
                            showError(container);
                        }

                        //console.log("mdm success, refreshing buttons");
                        window.refreshWinuiFormButtons();
                    } catch (ex) {
                        console.error("exception thrown in mdm success:");
                        console.error(ex);

                        showError(container);
                    } finally {
                        showSpinner(container, false);
                    }
                }
            }

            var successFunction = makeSuccess(container, debugThrow);

            function makeError(container, throwException) {
                return function (jqXhr, status, error) {
                    if (throwException) {
                        throw 'mdm debug test exception';
                    }

                    showSpinner(container, false);

                    //error
                    console.error('request:', jqXhr);
                    console.error('status:', status);
                    console.error('error:', error);
                    if (status == "timeout") {
                        showTryAgain(container);
                    } else {
                        showError(container);
                    }

                    window.refreshWinuiFormButtons();
                }
            }

            var errorFunction = makeError(container);

            function r(s) {
                return (s?s:"")+Math.random().toString(36).substring(2);
            }
            function r5() {
                return (""+Math.floor(Math.random()*99999)).padEnd(5,0);
            }

            var timeout = 2000;

            if (debugSuccess) {
                setTimeout(function() {
                    successFunction({
                        branchLocation: r("branchLocation"),
                        companyName: r("companyName"),
                        email: r() + "@example.org",
                        enterpriseId: r5(),
                        errorMessage: "Success",
                        firstName: r("firstName"),
                        hqAddress1: r5() + " " + r() + " St",
                        hqCity: r("city"),
                        hqState: r("state"),
                        hqZip: r5("zip"),
                        lastName: r("lastName"),
                        primaryPhoneNumber: "(555) 123-4567",
                        relationshipMgr: r("relationshipMgr"),
                        status: "200"
                    });
                }, timeout);
                return;
            }

            if (debugTimeout) {
                setTimeout(function() {
                    errorFunction("test", "timeout", "test");
                }, timeout);
                return;
            }

            if (debugError) {
                setTimeout(function() {
                    errorFunction("test", "test_error", "test");
                }, timeout);
                return;
            }

            $.ajax({
                url: endpoint,
                method: "GET",
                dataType: 'json',
                data: submitData,
                timeout: 270000,

                success: successFunction,
                error: errorFunction
            });
        }
    }

    function radioListener(container) {
        return function() {
            showSuccess(container, false);
            showError(container, false);
            showTryAgain(container, false);
        }
    }

    var containers = document.getElementsByClassName("mdm-winui-outer-wrapper");
    //console.log("containers for mdm: " + containers.length);
    for (var c = 0; c < containers.length; c++) {
        var container = containers[c];

        container.querySelector('input[name="mdm-validator"]').validate = function() {
            var container = this.parentElement;
            // console.log("returning mdm valid: " + container.completed);
            return container.completed;
        }
        container.querySelector('input[name="mdm-tin-entry"]').validate = function() {
            return this.value.length == 9;
        }
        container.querySelector('input[name="mdm-ssn-entry"]').validate = function() {
            return this.value.length == 9;
        }

        var buttons = container.querySelectorAll(".mdm-submit-winui");
        for (var i = 0; i < buttons.length; i++) {
            buttons[i].addEventListener("click", clickListener(container, buttons[i]));
        }

        var radios = container.querySelectorAll('input[type="radio"]');
        for (var i = 0; i < radios.length; i++) {
            radios[i].addEventListener("click", radioListener(container));
        }
    }
}

