            container.submitted = true;

            console.log("form sumbmission error: " + errorString);
            console.log(ex);
            //container.innerHTML = "There was a problem submitting your form. Please try again later."
            container.parentElement.innerHTML = formatThankYouMessage("Form submission error: " + errorString + "<br>" + ex);
