function winuiCaptchaReady() {
    return !!(window.grecaptcha && typeof(window.grecaptcha.render) === 'function');
}

function processWinuiFormCaptchas() {
    if (!winuiCaptchaReady()) {
        // console.log("Setting interval to wait for window.grecaptcha");
        window.winuiFormCaptchaInterval = setInterval(function() {
            if (winuiCaptchaReady()) {
                processWinuiFormCaptchas();
                clearInterval(window.winuiFormCaptchaInterval);
            }
        }, 10);
        return;
    }
    // console.log("Found grecaptcha");
    // console.log("processWinuiFormCaptchas");
    var captchas = document.querySelectorAll(".winui-form-recaptcha");

    if (captchas.length == 0) {
        // Do not run if no captchas on page
        return;
    }

    // if (!window.grecaptcha) {
    //     console.log("window.grecaptcha does not exist");
    // }

    function makeValidate(captcha) {
        return function() {
            var ret = !!window.grecaptcha.getResponse(captcha.key);
            // console.log("validating captcha with ID " + captcha.id + " with key " + captcha.key + ": " + ret);
            return ret;
        }
    }

    for (var i = 0; i < captchas.length; i++) {
        captchas[i].id = "winui-form-captcha-" + window.winuiFormCaptchaCounter++;
        captchas[i].key = window.grecaptcha.render(captchas[i].id, {
            sitekey: "6LeWAyETAAAAAFUjs_CPSPlzLL8agSwj_PoXrKDa",
            callback: WinuiFormCaptchaCallback,
            "expired-callback": WinuiFormCaptchaCallback,
            "error-callback": WinuiFormCaptchaCallback
        });
        var input = captchas[i].parentElement.querySelector("input");
        input.validate = makeValidate(captchas[i]);
    }

    WinuiFormCaptchaCallback();
}

window.processWinuiFormFunctions.push(processWinuiFormCaptchas);

