function processWinuiFormAddress() {

    var addressWrappers = document.querySelectorAll(".address-autocomplete-wrapper");

    function getShortName(place, placeType) {
        var components = place.address_components;
        for (var i = 0; i < components.length; i++) {
            var component = components[i];
            if (component.types.indexOf(placeType) > -1) {
                return component.short_name || component.long_name || "";
            }
        }
        return "";
    }

    function getPart(wrapper, partName) {
        return wrapper.querySelector('[data-address-part="' + partName + '"]');
    }

    function setValue(wrapper, partName, value) {
        var part = getPart(wrapper, partName);
        if (!part)
            return;

        if (part.type == "text") {
            part.value = value;

            var event = document.createEvent('Event');
            event.initEvent('input', true, true);
            part.dispatchEvent(event);

        } else if (part.tagName == "SELECT") {
            var options = part.querySelectorAll("option");
            for (var i = 0; i < options.length; i++) {
                options[i].selected = options[i].value == value;
            }

            var event = document.createEvent('Event');
            event.initEvent('change', true, true);
            part.dispatchEvent(event);
        }

        return part;
    }

    var getFillFunction = function(addressWrapper, autocomplete) {
        return function() {
            var place = autocomplete.getPlace();
            
            var number = getShortName(place, "street_number");
            var route = getShortName(place, "route");
            var address1 = number + (number ? " " : "") + route;

            var city = getShortName(place, "locality");
            var state = getShortName(place, "administrative_area_level_1");
            var zip = getShortName(place, "postal_code");

            //Recreate the element to prevent Google's dropdown from showing again during population
            var address1Wrapper = getPart(addressWrapper, "address1").parentElement;
            var address1HTML = address1Wrapper.innerHTML;
            address1Wrapper.innerHTML = "";
            address1Wrapper.innerHTML = address1HTML;

            var address1Part = setValue(addressWrapper, "address1", address1);
            setValue(addressWrapper, "address2", "")

            var parts = [
                address1Part,
                setValue(addressWrapper, "city", city),
                setValue(addressWrapper, "state", state),
                setValue(addressWrapper, "zip", zip),
            ];
            //Select a field if it's blank
            //Some might not exist due to being hidden by HTL
            for (var i = 0; i < parts.length; i++) {
                if (parts[i] && !parts[i].value) {
                    parts[i].focus();
                    break;
                }
            }

            initAutocomplete(address1Part);
        }
    }

    function initAutocomplete(addressInput) {
        // Create the autocomplete object, restricting the search predictions to geographical location types.
        var autocomplete = new google.maps.places.Autocomplete(
            addressInput, {types: ['geocode']}
        );
    
        // Avoid paying for data that you don't need by restricting the set of place fields that are returned to just the address components.
        autocomplete.setFields(['address_component']);

        // When the user selects an address from the drop-down, populate the address fields in the form.
        autocomplete.addListener('place_changed', getFillFunction(addressWrapper, autocomplete));
    }


    for (var a = 0; a < addressWrappers.length; a++) {
        var addressWrapper = addressWrappers[a];
        //var addressInput = addressWrapper.querySelector(".address-autocomplete-input");
        var addressInput = addressWrapper.querySelector('input[data-address-part="address1"]');

        //Refresh required fields
        var parts = addressWrapper.querySelectorAll('input:not([data-address-part="address1"])');
        for (var i = 0; i < parts.length; i++) {
            var event = document.createEvent('Event');
            event.initEvent('input', true, true);
            parts[i].dispatchEvent(event);
        }

        try {
            initAutocomplete(addressInput);
        } catch (ex) {
            console.log("Could not load google.maps.places.Autocomplete:");
            console.log(ex);
        }
    }
}

window.processWinuiFormFunctions = window.processWinuiFormFunctions || [];
window.processWinuiFormFunctions.push(processWinuiFormAddress);

