$(document).ready(function () {

  var testimonialCarousel = $("#testimonial-carousel");

  function getTestimonials() {
    if (typeof testimonialCarousel === 'undefined' || testimonialCarousel === null) {
      return;
    }

    var desktop = 992;
    var overlayOpacity = 0.85;
    var screenWidth = window.innerWidth;
    var button = $('.testimonials-teaser__button');
    var carouselItems = $('#testimonial-carousel .carousel-item').length;

    if (typeof button !== 'undefined' || button !== null) {
      $(button).find('.js-cmp-button').find('div').removeClass('d-flex');
      $(button).show();
    }

    $(window).resize(function () {
      screenWidth = window.innerWidth;
      adjustWidth(screenWidth);
    });

    function adjustWidth(width) {
      var card = $('.js-testimonial-card');
      $(testimonialCarousel).carousel({
        interval: 5000
      });

      if (carouselItems <= 3 && screenWidth >= desktop) {
        $(testimonialCarousel).carousel('pause');
        $(testimonialCarousel).data('interval', false); 
      } else {
        $(testimonialCarousel).carousel("cycle");
        $(testimonialCarousel).data('interval', true);
      }

      if (typeof card === 'undefined' || card === null) {
        return;
      }
      
      $('.js-testimonial-card').each(function () {
        var overlay = $(this).find('.card-body--overlay');
        if (typeof overlay === 'undefined' || card === null) {
          return;
        }
        if (width < desktop) {
          if ($(this).hasClass('card--hover')) {
            $(overlay).css("opacity", overlayOpacity);
          }
        } else {
          $(overlay).css("opacity", 0);
        }
      });

      
    }
    adjustWidth(screenWidth);

    $('#testimonial-carousel .carousel-item').each(function () {
      var minPerSlide = 1;
      if(carouselItems <= 2){
        minPerSlide = 0;
      }
      var next = $(this).next();
      if (!next.length) {
        next = $(this).siblings(':first');
      }
      next.children(':first-child').clone().appendTo($(this));

      for (var i = 0; i < minPerSlide; i++) {

        next = next.next();
        if (!next.length) {
          next = $(this).siblings(':first');
        }

        next.children(':first-child').clone().appendTo($(this));
      }
    });

    $('.js-testimonial-card').each(function () {
      var rawLocation = $(this).attr("data-link");
      if (typeof rawLocation !== 'undefined' && rawLocation !== '') {
        $(this).css('cursor', 'pointer');
        $(this).on("click", function () {
          window.location.href = encodeURI(rawLocation);
        });
      }
      //card overlay animation
      var bgcolor = $(this).css('background-color');
      if ($(this).hasClass('card--hover')) {
        var overlay = $(this).find('.card-body--overlay');
        $(overlay).css('background-color', bgcolor);
        $(this).on("mouseenter", function (e) {
          gsap.to(overlay, {
            opacity: overlayOpacity,
            duration: 0.125
          });
        }).on("mouseleave", function (e) {
          gsap.to(overlay, {
            opacity: 0,
            duration: 0.125
          });
        });
      }
    });
  }
  getTestimonials();
});
