WintrustFED.getCID = function() {
    var cid = WintrustFED.getQueryParam("cid");
    if (cid) {
        WintrustFED.setCookieValue("cid", cid);
        return cid;
    }

    cid = WintrustFED.getCookieValue("cid");
    if (cid) {
        return cid;
    }

    var LOFirstName = WintrustFED.getCookieValue("LOFirstName");
    var LOLastName = WintrustFED.getCookieValue("LOLastName");
    if (LOFirstName && LOLastName) {
        return "organic:blend:WTFCBlend:" + LOFirstName + LOLastName + "Direct:202105";
    }

    return "organic:blend:WTFCBlend:DirectOrganicTraffic:202105";
}

WintrustFED.appendCIDToBlendHref = function(button, href) {
    // console.log("appendCIDToBlendHref");
    // console.log(button);
    // console.log(href);
    var sp = href.split("://");
    var toCheck = sp.length > 1 ? sp[1] : sp[0];
    toCheck = toCheck.split("/")[0].toLowerCase();
    if ("zoom.wintrustmortgage.com" == toCheck) {
        // Is a blend link
        button.href += (href.indexOf("?") > -1 ? "&" : "?") + "app_source=" + WintrustFED.getCID();
        // console.log("Blend link set to " + button.href);
    }
}

