WintrustFED.Location.fetchBank = function (lat, lon, branchType) {
    /*
        GF: If branchType arg is empty then a single item will be returned.
        Alternatively, you pass "all" and an array of objects will be returned.
        In that case the format will be array.results
    */
    typeof lat === 'undefined' ? lat = 41.9913728 : lat;
    typeof lon === 'undefined' ? lon = -87.86575359999999 : lon;

    var hasBranchType = false,
        fetchBanksServletUrl = '/bin/wintrust/fetchbanks',
        params = {
            'lat': lat,
            'lon': lon
        };
    if (branchType) {
        params.branch_type = branchType;
        hasBranchType = true;
    }

    return $.ajax({
        'url': fetchBanksServletUrl,
        'data': params,
        'async': true,
        'dataType': 'json',
        success: function (data, textStatus, jqXHR) {
            var bankInfo;
            if (hasBranchType) {
                if ((data.results) && data.results.length > 0) {

                    data.results.sort(function (a, b) {
                        var distanceA = parseFloat(a.distance);
                        var distanceB = parseFloat(b.distance);
                        if (distanceA < distanceB) {
                            return -1;
                        }
                        if (distanceA > distanceB) {
                            return 1;
                        }
                        return 0;
                    });
                    bankInfo = data.results[0];
                }
            } else {
                bankInfo = data;
            }
            if (data.error) {
                return;
            }         
        },
        error: function (response) {}
    });
}

WintrustFED.Location.getLocationByGoogleApi = function () {
    var referer = $(location).attr('host');
    var googleMapsGeoLocationApiUrl = 'https://www.googleapis.com/geolocation/v1/geolocate?key=AIzaSyCF38reM2D4yceqQ01YczuNkiIm76fDu2A';
    return $.ajax({
        'url': googleMapsGeoLocationApiUrl,
        'dataType': 'json',
        'async': true,
        method: 'POST',
        beforeSend: function (xhr) {
            xhr.setRequestHeader('X-Alt-Referer', referer);
        },
        contentType: 'application/json;charset=UTF-8',
        success: function (data, textStatus, jqXHR) {
            var responseInfo = data;
            if (data.error) {
                isFinding = false;
                return;
            }

            if (responseInfo.location) {
                var bankType = null;
                currentLocation = {
                    'longitude': responseInfo.location.lng,
                    'latitude': responseInfo.location.lat
                };
                WintrustFed.fetchBank(currentLocation.latitude, currentLocation.longitude, bankType)
                    .done(function (result) {
                        return result;
                    }).fail(function () {
                        return console.error('Error processing request.')
                    });
            }
        },
        error: function (response) {

        }
    });
}

WintrustFED.Location.getCoordinatesFromInput = function (zipCodeOrAddress) {
    var geocoder = new google.maps.Geocoder();
    geocoder.geocode({
        'address': zipCodeOrAddress
    }, function (results, status) {
        if (status == 'OK') {
            if (results[0]) {
                if (results[0].geometry.location) {
                    currentLocation = {
                        'longitude': results[0].geometry.location.lng(),
                        'currentLocation': results[0].geometry.location.lat()
                    };
                    return currentLocation;                    
                }
            }
        } else {
            return null;
        }
    });
}
